(3, 18, '11 Saudi princes and 4 ministers detained\r\n', 'Crown Prince moves to consolidate power', '', '<p><strong>International Desk:</strong> A new Saudi anti-corruption body has detained 11 princes, four sitting ministers and dozens of former ministers, media reports say.</p>\r\n\r\n<p>The detentions came hours after the new committee, headed by Crown Prince Mohammed bin Salman, was formed by royal decree.</p>\r\n\r\n<p>Those detained were not named.</p>\r\n\r\n<p>BBC security correspondent Frank Gardner says Prince Mohammed is moving to consolidate his growing power while spearheading a reform programme.</p>\r\n\r\n<p>It is not clear what those detained are suspected of. However, Saudi broadcaster Al-Arabiya said fresh investigations had been launched into the 2009 Jeddah floods and the outbreak of the Mers virus which emerged in Saudi Arabia in 2012.</p>\r\n\r\n<p>The new anti-corruption committee has the power to issue arrest warrants and travel bans, the state-owned Saudi Press Agency (SPA) reported.</p>\r\n\r\n<p>Separately, the heads of the Saudi National Guard and the navy were replaced in a series of high-profile sackings.</p>\r\n\r\n<p>SPA said King Salman had dismissed National Guard minister Prince Miteb bin Abdullah and navy commander Admiral Abdullah bin Sultan bin Mohammed Al-Sultan.</p>\r\n\r\n<p>No official explanation was given for their removal.</p>\r\n\r\n<p>Prince Miteb, son of the late King Abdullah, was once seen as a contender for the throne and was the last member of Abdullah&#39;s branch of the family at the highest echelons of Saudi government.</p>\r\n\r\n<p>Our correspondent says Prince Mohammed, who already serves as defence minister, now has nominal control over all the country&#39;s security forces.</p>\r\n\r\n<p>Prince Mohammed recently said the return of &quot;moderate Islam&quot; was key to his plans to modernise Saudi Arabia.</p>\r\n\r\n<p>Addressing an economic conference in Riyadh, he vowed to &quot;eradicate the remnants of extremism very soon&quot;.</p>\r\n\r\n<p>Last year, Prince Mohammed unveiled a wide-ranging plan to bring social and economic change to the oil-dependent kingdom.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'boishakhi_1509865906.jpg', 'boishakhi_1509865906.jpg', 'boishakhi_1509865906.jpg', 'boishakhi_1509865906.jpg', NULL, NULL, 3, '11 Saudi princes and 4 ministers detained', 'Saudia Arabia, ministers, princes, dismissal, 05 November 2017 news, ', 'Saudia Arabia dismissed a number of senior ministers, detained nearly a dozen princes and created a new anti-corruption committee as part of a series of royal decrees, BBC and Aljazeera report quoting Saudi state media on Saturday', 12, 37, NULL, 0, 0, 1, 0, '05 November 2017 01:11:46', 'J Nandy', '05 November 2017 01:11:46', '2017-11-27 10:45:41', '2017-11-05 19:11:46'),
(4, 18, 'No nation should underestimate American resolve\r\n\r\n\r\n', 'Trump says after arriving in Japan', '', '<p><strong>International Desk:</strong> US President Donald Trump said no nation should underestimate American resolve, as he arrived in Japan at the start of a marathon Asian tour.</p>\r\n\r\n<p>Addressing US troops at Yokota air base near Tokyo, he pledged to ensure the military had the resources needed to keep peace and defend freedom, reports BBC.</p>\r\n\r\n<p>Trump&#39;s visit comes amid heightened tensions with North Korea over its nuclear programme and missile tests.</p>\r\n\r\n<p>It will be the longest tour of Asia by a US president in 25 years.</p>\r\n\r\n<p>&quot;No-one, no dictator, no regime... should underestimate American resolve,&quot; President Trump told cheering US and Japanese troops shortly after his arrival in Japan.</p>\r\n\r\n<p>Before touching down, he told reporters on board Air Force One that he expected to meet Russian President Vladimir Putin during his trip.</p>\r\n\r\n<p>&quot;I think it&#39;s expected we&#39;ll meet with Putin,&quot; he said. &quot;We want Putin&#39;s help on North Korea.&quot;</p>\r\n\r\n<p>Trump was meeting Japanese Prime Minister Shinzo Abe for lunch before the two leaders were due to play a round of golf.</p>\r\n\r\n<p>Stops in South Korea, China, Vietnam and the Philippines are also on the itinerary in the coming week.</p>\r\n\r\n<p>En route to Japan, the president stopped in Hawaii where he visited the USS Arizona Memorial at Pearl Harbor - the scene of the 1941 Japanese attack that drew the US into World War Two.</p>\r\n\r\n<p>He also took part in a briefing at the US Pacific Command.</p>\r\n\r\n<p>Trump has previously exchanged some fiery rhetoric with North Korea over its ballistic missile tests but aides said earlier this week that he would not go to the heavily fortified demilitarised zone (DMZ) on the border between the South and North.</p>\r\n\r\n<p>He is, however, to visit Camp Humphreys, a US military complex south of the capital, Seoul.</p>\r\n\r\n<p>In Vietnam, Trump will attend the Asia-Pacific Economic Co-operation summit in Da Nang and make a state visit to Hanoi.</p>\r\n\r\n<p>His final engagement is scheduled to be a summit of South-East Asian nations in the Philippine capital, Manila, on 13 November but the trip has now been extended by an extra day so he can attend the East Asia Summit.</p>\r\n\r\n<p>The last time a US president made such a marathon trip to Asia was when George HW Bush visited the region in late 1991 and early 1992.</p>\r\n', '', 'boishakhi_1509866665.jpg', 'boishakhi_1509866665.jpg', 'boishakhi_1509866665.jpg', 'boishakhi_1509866665.jpg', NULL, NULL, 3, 'No nation should underestimate American resolve', 'Donald Trump, US President, Asia tour, Japan, 05 November 2017 news, ', 'US President Donald Trump said no nation should underestimate American resolve, as he arrived in Japan at the start of a marathon Asian tour. Addressing US troops at Yokota air base near Tokyo, he pledged to ensure the military had the resources needed to keep peace and defend freedom', 18, 36, NULL, 0, 0, 1, 0, '05 November 2017 01:24:25', 'J Nandy', '05 November 2017 01:24:25', '2017-11-27 10:45:41', '2017-11-05 19:24:25'),
(5, 18, 'Apply pressure for early repatriation of Rohingyas ', 'Premier says while inaugurating 63rd CPC', '', '<div>\r\n<div>\r\n<div>\r\n<p><strong>Online Desk:</strong> Prime Minister Sheikh Hasina urged the Commonwealth countries to exert pressure on the Myanmar government to stop persecution on its Rohingya citizens and take them back from Bangladesh at the earliest.<br />\r\n<br />\r\nThe Prime Minister, who is also the vice-president of Commonwealth Parliamentary Association (CPA) the said this while inaugurating 63rd Commonwealth Parliamentary Conference (CPC) at a function at South Plaza of the Jatiya Sangsad Bhaban in the capital on Sunday.<br />\r\n<br />\r\nSheikh Hasina said, Bangladesh has given temporary shelter to huge number of Rohingyas on humanitarian ground. Her government is maintaining relations with foreign countries on the policy &#39;friendship to all, malice to none&#39;.<br />\r\n<br />\r\nEspecially, her government is eager to maintain good relations with neighbors, Sheikh Hasina said adding that her government has resolved many outstanding issues with India and Myanmar.<br />\r\n<br />\r\n&quot;But inhuman persecution meted out on the Rohingya population in the Rakhaine state of Myanmar and their forceful expulsion from their homeland have created instability in the region and beyond,&quot; she said.<br />\r\n<br />\r\n&quot;I would like to request you all to discuss the Rohingya issue with utmost importance and exert pressure on the Myanmar government to stop persecution on its citizens and take them back at the earliest,&quot; Sheikh Hasina said.<br />\r\n<br />\r\nOver 6.22 hundred thousand Myanmar nationals have fled to Bangladesh to escape persecution. After 1978, another five hundred thousands of Rohingyas came to Bangladesh at different times, she added.<br />\r\n<br />\r\nReiterating her call to Commonwealth countries to be united to get rid of militancy and terrorism the Prime Minister said thoughtless acts of a section of people are claiming innocent lives. Recent terror attack in New York claimed eight precious lives. Militancy is not a problem of a particular country, rather it became a global phenomenon, she said. Chairperson of CPA and Speaker of Jayita Sangsad of Bangladesh Dr Shirin Sharmin Choudhury gave welcome address while Secretary-General of the CPA Akbar Khan, Commonwealth youth representative Aiman Sadique and treasurer of CPA Vicki Dunn spoke, among others, on the occasion.<br />\r\n<br />\r\nMessages of Queen Elizabeth (II) and Secretary General of the Commonwealth Secretariat Patricia Scotland were read out on the occasion.<br />\r\n<br />\r\nThe magnificent inauguration of the 63rd CPA Conference was marked by presentation of a number of documentaries on Bangladesh&#39;s history, nature and livelihood of the people as well as brilliant performances of artistes of Bangladesh Shilpakala Academy and dance troupe &#39;Nrithanchan&#39;.<br />\r\n<br />\r\nPrime Minister Sheiukh Hasina expected immediate implementation of the promises made at different times to offset the adverse impacts of climate change. Bangladesh as one of the worst victims of the climate change is experiencing its colossal effects. Excessive precipitation and recurrence of flooding washed away vast localities and damaged standing crops in recent times, she pointed out.<br />\r\n<br />\r\nSheikh Hasina said she was deeply honoured to have the opportunity to inaugurate the 63rd Commonwealth Parliamentary Conference (CPC) in this historic city of Dhaka.<br />\r\n<br />\r\nWelcoming the distinguished guests on behalf of the people of Bangladesh, Sheikh Hasina, also the vice patron of the 63rd Commonwealth Parliamentary Conference said she was confident that CPA conference would give the countries a clearer insight into democratic values and practices.<br />\r\n<br />\r\n&quot;We Parliamentarians, being the people&#39;s representatives, have the first and foremost obligations to preserve and maintain the faith of the people in democracy and parliamentary institutions,&quot; she said.<br />\r\n<br />\r\nThe CPA and Bangladesh Jatiya Sangsad are jointly hosting the conference with the theme: Continuing to enhance the high standards of performance of parliamentarians. More than 550 delegates from 144 national and provincial parliaments of 44 countries joined the conference.<br />\r\n<br />\r\nSheikh Hasina said it was the pragmatic and far-reaching decision of the Father of the Nation Bangabhandu Sheikh Mujibur Rahman to join the Commonwealth Parliamentary Association (CPA) in 1973. And, Bangladesh was proud of having first woman Chairperson of the CPA in 2014, now a forum of total of 52 countries which once were territories of British Empire.<br />\r\n<br />\r\n&quot;This is a testimony by the honorable members of the parliament across the Commonwealth towards our commitment to democratic practices and values,&quot; she noted.<br />\r\n<br />\r\nSheikh Hasina said Bangladesh has become a sovereign and an independent democratic country through huge sacrifices as cherished desire of the people of this land. Father of the Nation Bangabandhu Sheikh Mujibur Rahman had led the struggle from the forefront.<br />\r\n<br />\r\nHighlighting Bangladesh&#39;s topsy-turvy democratic journey since independence the Prime Minister said the reactionary defeated forces of 1971 assassinated Bangabandhu along with most of his family members on August 15, 1975 when he was engaged in reconstruction and rehabilitation of the war- ravaged country.<br />\r\n<br />\r\nBut, she and her sister Sheikh Rehana survived the incident as they were abroad on that fateful night. Later, they were barred from returning home. With the killing of Bangabandhu, she recalled, democracy in Bangladesh was assailed and the era of military dictatorship started.<br />\r\n<br />\r\nSheikh Hasina said she engaged herself in the struggle for restoration of democracy in Bangladesh while she was in exile. Ending six years in exile, she returned home in 1981. Since then she had to endure huge sufferings while struggling for establishing people&#39;s rule.<br />\r\n<br />\r\nShe said repeated attempts were made on her life along with house-arrest and internment and thousands of workers and leaders became victims of massive repression of the rulers after 1975. But none could restrain her from the struggle for the restoration of democracy as she thought that only a democratic polity can ensure uplift of people&#39;s living standard through fulfilling their basic needs.<br />\r\n<br />\r\nThe Prime Minister said after long 21 years, her party Awami League returned to state power in 1996 and engaged in fulfilling the basic needs of people not as a ruler but as a public servant.<br />\r\n<br />\r\nSheikh Hasina said the foremost aim of her government is to build a hunger and poverty free Bangladesh through strengthening the foundation of democratic rule. To fulfill the goal, she said, the government has framed &#39;Vision- 2021&#39;. The government is working to achieve the visions with specific plans, she said.<br />\r\n<br />\r\nThe Prime Minister said her government has strengthened various democratic institutions, including national parliament and local government bodies. Elected representatives are leading the local government bodies. Bangladesh is now at the top of the countries in South Asia in terms of women empowerment and achieving gender parity, she said.<br />\r\n<br />\r\nSheikh Hasina said her government has ensured the freedom of mass media and people&#39;s right to information as independent and strong mass media are the vigilant watchdog of democracy. In the past few years Bangladesh have witnessed huge expansion of mass media, she said.<br />\r\n<br />\r\nUnderlining the socio-economic development of Bangladesh the Prime Minister said her government is implementing the SDGs in continuation of the successes of the MDGs. The subjects of SDGs have been incorporated in our 7th 5-year plan.<br />\r\n<br />\r\n&quot;Bangladesh has been in a journey through the roads of peace, democracy, development and prosperity.&quot; she said adding that Bangladesh will emerge as a middle incoming country by 2021 when it will celebrate the Golden Jubilee of its Independence. Bangladesh will be a developed one by 2041, she optimistically said.<br />\r\n<br />\r\nShe urged the Commonwealth leaders to work together to make the planet a peaceful, happy and prosperous abode for the entire humanity and hoped that stay of the CPA dignitaries in Bangladesh would be joyful and memorable one.</p>\r\n</div>\r\n</div>\r\n</div>\r\n', '', 'boishakhi_1509867726.jpg', 'boishakhi_1509867726.jpg', 'boishakhi_1509867726.jpg', 'boishakhi_1509867726.jpg', NULL, NULL, 3, 'Apply pressure for early repatriation of Rohingyas: PM', 'Sheikh Hasina, CPC, CPA, 05 November 2017 news, ', 'Prime Minister Sheikh Hasina urged the Commonwealth countries to exert pressure on the Myanmar government to stop persecution on its Rohingya citizens and take them back from Bangladesh at the earliest', 22, 35, NULL, 0, 0, 1, 0, '05 November 2017 01:42:18', 'J Nandy', '05 November 2017 01:42:06', '2017-11-27 10:45:41', '2017-11-05 19:42:06'),
(6, 18, '2 killed in Savar road mishap', '', '', '<p><strong>Staff Reporter:</strong> Two persons including a rickshaw passenger have been killed when a sand-laden truck turned turtle in Savar.</p>\r\n\r\n<p>Three more persons are also injured in this accident. The injured have been admitted in different local clinics. The mishap took place on Dhaka-Aricha Highway at Pakija area of Savar last night.</p>\r\n\r\n<p>Police and the eye-witnesses said, the Dhaka-bound truck after losing control hit a rickshaw and then turned turtle beside the highway. A passenger of the ill-fated rickshaw and another person died being suppressed under the heap of sand.</p>\r\n\r\n<p>The truck driver and his helper have been absconding since the mishap.</p>\r\n', '', 'boishakhi_1509868307.jpg', 'boishakhi_1509868307.jpg', 'boishakhi_1509868307.jpg', 'boishakhi_1509868307.jpg', NULL, NULL, 3, '2 killed in Savar road mishap', 'Savar, road accident, killed, 05 November 2017 news, ', 'Two persons including a rickshaw passenger have been killed when a sand-laden truck turned turtle in Savar. Three more persons are also injured in this accident. The injured have been admitted in different local clinics', 8, 43, NULL, 0, 0, 1, 0, '05 November 2017 01:52:12', 'J Nandy', '05 November 2017 01:51:47', '2017-11-27 10:45:41', '2017-11-05 19:51:47'),
(7, 18, 'NBR introduces Income Tax ID Card', 'Holders to enjoy government services on priority basis', '', '<p><strong>Staff Reporter:</strong> National Board of Revenue (NBR) has introduced &lsquo;Income Tax ID Card&rsquo; or Smart Card this year to motivate people to pay the tax. The card holders will be able to enjoy the services provided by the state on priority basis.</p>\r\n\r\n<p>The Income Tax Fair being held in Revenue Building at Agargaon in the capital is crowded with tax payers and service takers from morning to evening. Here the tax payers are enjoying all the NBR facilities under the same roof including income tax deposition, return submission, filling up different forms, tax counseling, disposal of tax dispute etc.</p>\r\n\r\n<p>The tax payers are getting the card from the concerned booth after submitting income tax returns there. NBR said, this is being done to honour the tax payers. They will get services from different government offices on priority basis by showing the card.</p>\r\n\r\n<p>The newly-introduced smart card has created a great response among the income tax payers. After submitting the return papers, they wait patiently in long queues to collect the card, though many of them have no idea what they will do with it.</p>\r\n\r\n<p>Concerned officials said, the smart card is being given as a part of the plan of digitalising the NBR services. OR code is inscribed on this card. Though the card is being given primarily to honour the income tax payers, but they will be able to enjoy different NBR services on priority basis in future. The smart card is made by collecting information on the tax payers from their national ID card data base.</p>\r\n\r\n<p>This year income tax fairs are being held in 187 places including the capital. Primarily, the income tax ID cards or smart cards being distributed in the fairs being held at Dhaka, Chittagong and Sylhet.</p>\r\n', '', 'boishakhi_1509869461.jpg', 'boishakhi_1509869461.jpg', 'boishakhi_1509869461.jpg', 'boishakhi_1509869461.jpg', NULL, NULL, 3, 'NBR introduces Income Tax ID Card', 'Income Tax ID Card, NBR, 05 November 2017 news, ', 'National Board of Revenue (NBR) has introduced ‘Income Tax ID Card’ or Smart Card this year to motivate people to pay the tax. The card holders will be able to enjoy the services provided by the state on priority basis', 344, 38, NULL, 0, 1, 1, 0, '05 November 2017 02:21:31', 'J Nandy', '05 November 2017 02:11:01', '2017-11-27 10:45:41', '2017-11-05 20:11:01'),
(8, 18, 'SC extends time for issuing gazette notification', 'Disciplinary and conduct rules for lower court judges', '', '<p><strong>Court Reporter:</strong> The Supreme Court has extended time until December 3 for issuing a gazette notification on the disciplinary and conduct rules for lower court judges.</p>\r\n\r\n<p>The five-member bench of the Appellate Division headed by Justice Abdul Wahhab Miah passed the order following a time petition moved by Attorney General Mahbubey Alam.</p>\r\n\r\n<p>In the petition, the attorney general prayed to the apex court seeking four-week time for settling the issues. The Supreme Court has so far given the government time for issuing the gazette notification for 26 times in more than two years.</p>\r\n\r\n<p>The lower judiciary was officially separated in November 2007 but the disciplinary rules for lower court judges are yet to be finalised.</p>\r\n', '', 'boishakhi_1509871887.jpg', 'boishakhi_1509871887.jpg', 'boishakhi_1509871887.jpg', 'boishakhi_1509871887.jpg', NULL, NULL, 3, 'SC extends time for issuing gazette notification', 'gazette notification, disciplinary and conduct rules, lower court judges, 05 November 2017 news, ', 'The Supreme Court has extended time until December 3 for issuing a gazette notification on the disciplinary and conduct rules for lower court judges. The five-member bench of the Appellate Division headed by Justice Abdul Wahhab Miah passed the order', 18, 39, NULL, 0, 0, 1, 0, '05 November 2017 02:51:27', 'J Nandy', '05 November 2017 02:51:27', '2017-11-27 10:45:41', '2017-11-05 20:51:27'),
(9, 18, 'Ruling partymen laundering bank money: Rizvi', '', '', '<p><strong>Staff Reporter:</strong> BNP Senior Joint Secretary General Ruhul Kabir Rizvi alleged that activists of ruling party are laundering thousands of crores of taka in the name of receiving loans from different private banks.</p>\r\n\r\n<p>He came up with the allegation while addressing a press conference at Nayapalton Party Central office on Sunday morning.</p>\r\n\r\n<p>Rizvi also said that general clients of banks are now worried due to the plunder of ruling partymen. Referring that BNP is willing to hold a peaceful rally at Suhrawardy Udyan on November 8, he expressed optimism that government will permit to organise the rally. &nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1509872538.jpg', 'boishakhi_1509872538.jpg', 'boishakhi_1509872538.jpg', 'boishakhi_1509872538.jpg', NULL, NULL, 3, 'Ruling partymen laundering bank money: Rizvi', 'Ruhul Kabir Rizvi, BNP, 05 November 2017 news, ', 'BNP Senior Joint Secretary General Ruhul Kabir Rizvi alleged that activists of ruling party are laundering thousands of crores of taka in the name of receiving loans from different private banks.\r\nHe came up with the allegation', 11, 40, NULL, 0, 0, 1, 0, '05 November 2017 03:03:54', 'J Nandy', '05 November 2017 03:02:18', '2017-11-27 10:45:41', '2017-11-05 21:02:18'),
(10, 18, 'Death toll rose to 27 as Typhoon Damrey hits Vietnam ', 'Typhoon Damre', '', '<p><strong>International Desk:</strong> The death toll rose to at least 27 on Sunday (Nov 5) from the typhoon that pummelled central and southern Vietnam just days before the region is due to host the APEC summit of Asia-Pacific leaders.</p>\r\n\r\n<p>Typhoon Damrey, the 12th major storm to hit Vietnam this year, made landfall on Saturday with winds of up to 90 km/h (56 mph) that damaged more than 40,000 homes, knocked down electricity poles and uprooted trees.</p>\r\n\r\n<p>The communist state&#39;s Steering Committee for Disaster Prevention said 27 people were now counted dead and 22 were missing. It said 626 houses had collapsed entirely in a trail of destruction that has forced the evacuation of more than 30,000 people.</p>\r\n\r\n<p>Heavy rain and high winds lashed the coastal strip on Sunday. Flooding led to a 30 km (19 miles) tailback on Vietnam&#39;s main north-south highway in Thua Thien Hue province.</p>\r\n\r\n<p>Battle tanks were mobilised to help with rescue efforts.</p>\r\n\r\n<p>&quot;The floodwaters are rising very fast,&quot; said Dinh Cong Hoa, deputy commander of the provincial military command in Nha Trang, which bore the brunt of the typhoon.</p>\r\n\r\n<p>One middle-aged woman in Nha Trang, Vo Thi Tuyet Anh, told state television: &quot;I&rsquo;ve never seen such a strong storm since I was born.</p>\r\n\r\n<p>Danang, where the Asia-Pacific Economic Cooperation (APEC) summit is taking place this week, is around 500 km (310 miles) to the north of Nha Trang. It also suffered.</p>\r\n\r\n<p>A gateway proclaiming &quot;Welcome to Danang&quot; collapsed in the storm, state media said. Authorities in the area called on citizens to volunteer to help clean up.</p>\r\n\r\n<p>Danang will host U.S. President Donald Trump from Nov. 10, as well as China&#39;s Xi Jinping, Russia&#39;s Vladimir Putin and counterparts from other APEC members.</p>\r\n\r\n<p>The storm moved from the coastal area into a key coffee-growing region of the world&#39;s biggest producer of robusta coffee beans. Traders had expected the storm to delay harvesting, but were not sure whether it would damage the crop.</p>\r\n\r\n<p>The government said on Saturday more than 40,000 hectares of crops had been damaged, including sugar cane, rice fields and rubber plantations.</p>\r\n\r\n<p>Floods killed more than 80 people in northern Vietnam last month, while a typhoon wreaked havoc in central provinces in September. The country of more than 90 million people is prone to destructive storms and flooding due to its long coastline.</p>\r\n', '', 'boishakhi_1509873792.jpg', 'boishakhi_1509873792.jpg', 'boishakhi_1509873792.jpg', 'boishakhi_1509873792.jpg', NULL, NULL, 3, 'Death toll rose to 27 as Typhoon Damrey hits Vietnam', 'Vietnam, Typhoon Damrey, deaths, 05 November 2017 news, ', 'The death toll rose to at least 27 on Sunday (Nov 5) from the typhoon that pummelled central and southern Vietnam just days before the region is due to host the APEC summit of Asia-Pacific leaders', 42, 42, NULL, 0, 0, 1, 0, '05 November 2017 03:23:12', 'J Nandy', '05 November 2017 03:23:12', '2017-11-27 10:45:41', '2017-11-05 21:23:13'),
(11, 18, 'Getting back Chief Justice\'s post impossible for S K Sinha ', 'Attorney General tells reporters', '', '<p><strong>Staff Reporter:</strong> Attorney General Mahbubey Alam said that it is almost impossible for Chief Justice Surendra Kumar (S. K.) Sinha to get back the post again after he returns home.</p>\r\n\r\n<p>He made the remark while talking to reporters on Sunday. Earlier on October 14, he came up with the same comment.</p>\r\n\r\n<p>Chief Justice left for Australia by a flight of Singapore airlines on last 13 October. Earlier, he went for 1 month vacation mentioning physical illness. Later, he extended his vacation for 10 days. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1509874986.jpg', 'boishakhi_1509874986.jpg', 'boishakhi_1509874986.jpg', 'boishakhi_1509874986.jpg', NULL, NULL, 3, 'Getting back Chief Justice\'s post impossible for S K Sinha', 'Attorney General Mahbubey Alam, 05 November 2017 news, Chief Justice Surendra Kumar Sinha,', 'Attorney General Mahbubey Alam said that it is almost impossible for Chief Justice Surendra Kumar (S. K.) Sinha to get back the post again after returning to homeland. He made the remark while talking to reporters on Sunday. Earlier on October 14, he came up with the same comment', 24, 41, NULL, 0, 0, 1, 0, '05 November 2017 03:49:53', 'J Nandy', '05 November 2017 03:43:06', '2017-11-27 10:46:05', '2017-11-05 21:43:06'),
(12, 18, '26 worshipers massacred by gunman in Texas church\r\n\r\n\r\n', 'Victims include child, pregnant woman', '', '<p><strong>International Desk:</strong> At least 26 worshippers, including a five-year-old and a pregnant woman, were killed when a gunman opened fire inside a small church in a quiet Texas town on Sunday.</p>\r\n\r\n<p>America&#39;s latest mass shooting happened during a Sunday service at the First Baptist Church in Sutherland Springs, a community of 400 people about 30 miles southeast of San Antonio, repots The Telegraph..</p>\r\n\r\n<p>Texas Governor Greg Abbott said 26 people died, with the victims ranging in age from 5 to 72 years old.</p>\r\n\r\n<p>The gunman was dressed all in black tactical gear with a ballistic vest and had an assault rifle, Texas Department of Public Safety spokesman Freeman Martin said.</p>\r\n\r\n<p>He said the gunman arrived at a gas station across from the church at around 11:20 a.m. He crossed the street and started firing a Ruger AR rifle at the church, and continued after entering the building.</p>\r\n\r\n<p>As he left, he was confronted by an armed resident who chased him. A short time later, the suspect was found dead in his vehicle at the county line, Martin said. There were several weapons inside.</p>\r\n\r\n<p>Martin said it&#39;s unclear if the attacker died of a self-inflected wound or if he was shot by the resident who confronted him.</p>\r\n\r\n<p>Police inspect the car which the alleged gunman used to drive from the scene of the shooting</p>\r\n\r\n<p>Police inspect the car which the alleged gunman used to drive from the scene of the shooting Credit: Universal News (Europe)</p>\r\n\r\n<p>A total of 23 victims were found dead in the church, two were found outside the church, and one person died in hospital.</p>\r\n\r\n<p>No motive was given for what Mr Abbott said was the worst mass shooting in modern Texas history.</p>\r\n\r\n<p>The gunman was named by US media outlets as Devin Kelley, 26, who lived in San Antonio.</p>\r\n\r\n<p>Kelley was dishonourably discharged from the Air Force after facing a court martial in 2014, CBS News reported.</p>\r\n\r\n<p>Among the victims was the teenage daughter of the pastor at the small Texas church.</p>\r\n\r\n<p>Pastor Frank Pomeroy said he and his wife Sherri were out of town when the attack happened at the First Baptist Church but their 14-year-old daughter Annabelle was among more than 20 killed.</p>\r\n\r\n<p>Annabelle &ldquo;was one very beautiful, special child,&rdquo; Pomeroy told ABC News.</p>\r\n\r\n<p>His wife said &ldquo;many friends&rdquo; had died.</p>\r\n\r\n<p>Nick Uhlig, a 34-year-old church member who didn&rsquo;t attend on Sunday, said his cousins were at the service and that his family was told at least one of them, a pregnant woman with three children, was among the dead. &ldquo;We just gathered to bury their grandfather on Thursday,&rdquo; he said. &ldquo;This is the only church here.</p>\r\n\r\n<p>&ldquo;We have Bible study, men&rsquo;s Bible study, vacation Bible school.&rdquo;</p>\r\n\r\n<p>US President Donald Trump on Monday condemned what he described as a &quot;horrific shooting&quot;.</p>\r\n\r\n<p>&quot;This act of evil occurred as the victims and their families were in their place of worship. Our hearts are broken,&quot; Trump said on a visit to Japan.</p>\r\n\r\n<p>&quot;Americans do what we do best, we pull together,&quot; Mr Trump said at the start of a meeting with business leaders. &quot;We stand strong, oh so strong.&quot;</p>\r\n\r\n<p>He added federal authorities would help Texas in the aftermath of the shooting and that all of America was praying to God.</p>\r\n\r\n<p>Theresa May, the British Prime Minister, tweeted: &quot;Tragic loss of life in Sutherland Springs, Texas. Thoughts and prayers with all those affected by this terrible shooting.&quot;</p>\r\n\r\n<p>Sunday services at the small white church are usually attended by about 50 people, local residents said.</p>\r\n\r\n<p>It was not immediately clear if the gunman was shot by officers or killed himself.</p>\r\n\r\n<p>&quot;There was no police chase,&quot; sheriff&#39;s spokesman Sergeant Robert Murphy in neighbouring Guadalupe County said, denying earlier media reports that the gunman was killed after a pursuit. &quot;He was in his vehicle.&rdquo;</p>\r\n\r\n<p>Wilson County Commissioner Albert Gamez Jr said his &quot;heart is broken&quot;.</p>\r\n\r\n<p>Emergency personnel respond to a fatal shooting at a Baptist church in Sutherland Springs, Texas.</p>\r\n\r\n<p>Emergency personnel respond to a fatal shooting at a Baptist church in Sutherland Springs, Texas Credit: KSAT via AP.</p>\r\n\r\n<p>&quot;You never think this can happen but it can, it doesn&#39;t matter where you&#39;re at. Look at what can happen. It&#39;s a tragic day, massive.&quot;</p>\r\n\r\n<p>He added: &quot;The gunman took off. They were in a pursuit. They told me he&#39;s deceased, I don&#39;t know if he shot himself or not.</p>\r\n', '', 'boishakhi_1509937636.jpg', 'boishakhi_1509937636.jpg', 'boishakhi_1509937636.jpg', 'boishakhi_1509937636.jpg', NULL, NULL, 3, '26 worshipers massacred by gunman in Texas church', 'Texas, USA, church, gunman, shooting, massacre, 06 November 2017 news, ', 'At least 26 worshippers, including a five-year-old and a pregnant woman, were killed when a gunman opened fire inside a small church in a quiet Texas town on Sunday. America\'s latest mass shooting happened during a Sunday service at', 9, 25, NULL, 0, 0, 1, 0, '06 November 2017 09:07:16', 'J Nandy', '06 November 2017 09:07:16', '2017-11-27 10:45:41', '2017-11-06 15:07:16'),
(13, 18, 'Tax haven secrets of Elizabeth, Trump and other ultra-rich exposed', 'Paradise Papers leak', '', '<p><strong>International Desk:</strong> A huge new leak of financial documents has revealed how the powerful and ultra-wealthy, including the Queen&#39;s private estate, secretly invest vast amounts of cash in offshore tax havens.</p>\r\n\r\n<p>Donald Trump&#39;s commerce secretary is shown to have a stake in a firm dealing with Russians sanctioned by the US.</p>\r\n\r\n<p>The leak, dubbed the Paradise Papers, contains 13.4m documents, mostly from one leading firm in offshore finance, reports BBC.</p>\r\n\r\n<p>As with last year&#39;s Panama Papers leak, the documents were obtained by the German newspaper S&uuml;ddeutsche Zeitung, which called in the International Consortium of Investigative Journalists (ICIJ) to oversee the investigation. The Guardian is also among the organisations investigating the documents.</p>\r\n\r\n<p>Sunday&#39;s revelations form only a small part of a week of disclosures that will expose the tax and financial affairs of some of the hundreds of people and companies named in the data, some with strong UK connections.</p>\r\n\r\n<p>Many of the stories focus on how politicians, multinationals, celebrities and high-net-worth individuals use complex structures of trusts, foundations and shell companies to protect their cash from tax officials or hide their dealings behind a veil of secrecy.</p>\r\n\r\n<p>The vast majority of the transactions involve no legal wrongdoing.</p>\r\n\r\n<p>A key aide of Canada&#39;s PM has been linked to offshore schemes that may have cost the nation millions of dollars in taxes, threatening to embarrass Justin Trudeau, who has campaigned to shut tax havens. Read the full story here</p>\r\n\r\n<p>Lord Ashcroft, a former Conservative party deputy chairman and a significant donor, may have ignored rules around how his offshore investments were managed. Read the full story here Other papers suggest he retained his non-dom status while in the House of Lords, despite reports he had become a permanent tax resident in the UK.</p>\r\n', '', 'boishakhi_1509939325.jpg', 'boishakhi_1509939325.jpg', 'boishakhi_1509939325.jpg', 'boishakhi_1509939325.jpg', NULL, NULL, 3, 'Tax haven secrets of Elizabeth, Trump and other ultra-rich exposed', 'Paradise Papers leak, Queen Elizabeth, Donald Trump, 06 November 2017 news, ', 'A huge new leak of financial documents has revealed how the powerful and ultra-wealthy, including the Queen\'s private estate, secretly invest vast amounts of cash in offshore tax havens. Donald Trump\'s commerce secretary is shown', 10, 26, NULL, 0, 0, 1, 0, '06 November 2017 09:35:25', 'J Nandy', '06 November 2017 09:35:25', '2017-11-27 10:45:41', '2017-11-06 15:35:25'),
(14, 18, 'Dhaka Dynamite secures first win in BPL', '', '', '<p><strong>Sports Reporter:</strong> Dhaka Dynamites have secured their victory in their first match in Bangladesh Premier League (BPL) cricket on Sunday. In the second match of the day at the Sylhet International Stadium, Dhaka defeats Khulna Titans by 65 runs.</p>\r\n\r\n<p>&nbsp;\r\n<p>Losing the toss and electing to bat, the recent champions bagged 202 runs in exchange of 7 wickets. In reply, Khulna Titans were all out securing 137 runs.</p>\r\n</p>\r\n\r\n<p>Earlier on the day, Sylhet Sixers secured their win defeating Comilla Victorians by 4 wickets in the first match. Comilla was sent to batting after losing the toss, and collected 145 runs. In reply, Sylhet scored winning target of 146 runs keeping one wicket in hand. &nbsp;</p>\r\n', '', 'boishakhi_1509941034.jpg', 'boishakhi_1509941034.jpg', 'boishakhi_1509941034.jpg', 'boishakhi_1509941034.jpg', NULL, NULL, 3, 'Dhaka Dynamite secures first win in BPL', 'BPL, cricket, results, 06 November 2017 news, ', ' Dhaka Dynamites have secured their victory in their first match in Bangladesh Premier League (BPL) cricket on Sunday. In the second match of the day at the Sylhet International Stadium, Dhaka defeats Khulna Titans by 65 runs', 31, 33, NULL, 0, 0, 1, 0, '06 November 2017 10:03:54', 'J Nandy', '06 November 2017 10:03:54', '2017-11-27 10:45:41', '2017-11-06 16:03:54'),
(15, 18, 'Real bounces back from loss to defeat Las Palmas', 'Spanish La Liga results', '', '<p><strong>Sports Desk:</strong> Marco Asensio scored one of the best goals of the La Liga season as Real Madrid bounced back from their loss at Tottenham to defeat Las Palmas by 3-0.</p>\r\n\r\n<p>Real have yet to hit the performance heights that led them to last season&#39;s league-European double, but on Sunday the display was far better than they managed in midweek.</p>\r\n\r\n<p>Goal from Casemiro at the 41<sup>st</sup> minutes, Asensio at the 56<sup>th</sup> minutes and Isco&rsquo;s goal at the 74<sup>th</sup> minutes secured Real to clinch the victory.</p>\r\n\r\n<p>Real are now third, level on points with fourth-place Atletico, and eight points behind league leaders Barcelona, who have 31 points.</p>\r\n\r\n<p>In other matches, Girona defeated Levante by 2-1, Celta Vigo secured win defeating Athletico Bilbao by 3-1, Real Sociedad gained victory defeating Eibar by 3-1 and Villarreal clinches the win over Malaga by 2-1 goals.&nbsp;</p>\r\n', '', 'boishakhi_1509943993.jpg', 'boishakhi_1509943993.jpg', 'boishakhi_1509943993.jpg', 'boishakhi_1509943993.jpg', NULL, NULL, 3, 'Real bounces back from loss to defeat Las Palmas', 'La Liga, Spanish Football League, Real Madrid, 06 November 2017 news, ', 'Marco Asensio scored one of the best goals of the La Liga season as Real Madrid bounced back from their loss at Tottenham to defeat Las Palmas by 3-0. Real have yet to hit the performance heights that led them to last season\'s league-European doubl', 16, 34, NULL, 0, 0, 1, 0, '06 November 2017 12:32:10', 'J Nandy', '06 November 2017 10:53:13', '2017-11-27 10:45:41', '2017-11-06 16:53:13'),
(16, 18, 'Saudi prince killed in chopper crash near Yemen border', 'Cause of the accident unknown yet', '', '<p><strong>International Desk:</strong> A Saudi prince has been killed when the helicopter he was travelling in crashed near the border with Yemen, BBC reported quoting state television.</p>\r\n\r\n<p>Prince Mansour bin Muqrin, the deputy governor of Asir province, was travelling with several officials when the helicopter crashed, Al-Ikhbariya news channel said.</p>\r\n\r\n<p>The cause of the crash is unknown.</p>\r\n\r\n<p>Saudi Arabia said it intercepted a ballistic missile, fired from Yemen, near Riyadh airport the day before.</p>\r\n\r\n<p>Also this weekend, an anti-corruption purge targeted dozens of people, including 11 princes and four ministers, in a move seen to cement the power of the heir to the throne.</p>\r\n\r\n<p>The anti-corruption body is led by Crown Prince Mohammed bin Salman.</p>\r\n\r\n<p>Prince Mansour bin Muqrin, who died in the crash, is the son of another former crown prince.</p>\r\n\r\n<p>His father, Muqrin bin Abdul Aziz, was pushed aside by his half-brother King Salman a few months after he took the throne in 2015.</p>\r\n\r\n<p>The fate of the other occupants of the helicopter remains unclear, but Saudi news outlet Okaz said that unconfirmed reports suggested there were no survivors.</p>\r\n\r\n<p>The group had been carrying out an aerial inspection of the region at the time, it said.</p>\r\n', '', 'boishakhi_1509945381.jpg', 'boishakhi_1509945381.jpg', 'boishakhi_1509945381.jpg', 'boishakhi_1509945381.jpg', NULL, NULL, 3, 'Saudi prince killed in chopper crash near Yemen border', 'Saudi Prince, Mansour bin Muqrin, helicopter crash, killed, 06 November 2017 news, ', 'A Saudi prince has been killed when the helicopter he was travelling in crashed near the border with Yemen, BBC reported quoting state television. Prince Mansour bin Muqrin, the deputy governor of Asir province', 43, 122, NULL, 0, 0, 1, 0, '07 November 2017 11:58:11', 'J Nandy', '06 November 2017 11:16:21', '2017-11-27 10:45:41', '2017-11-06 17:16:21'),
(17, 18, 'CPC: Bangladesh gives special emphasis on Rohingya issue', 'World leaders vow to remain beside Dhaka', '', '<p><strong>Special Report:</strong> Different significant issues including development of parliamentary democracy, poverty eradication and empowerment of women were given importance in the first phase of Commonwealth Parliamentary Conference (CPC).</p>\r\n\r\n<p>&nbsp;\r\n<p>Issues like Rohingya crisis are also included in the agenda of the first session. Host Bangladesh also gives special priorities in this regard.</p>\r\n</p>\r\n\r\n<p>International representatives taking part in the conference are hopeful of ushering meaningful changes in the regional and international stage by implementing the proposals taken in the meeting of the Commonwealth Parliamentary Association (CPA)&rsquo;s executive committee.</p>\r\n\r\n<p>Discussion meetings have been held since the beginning of CPC, which were participated by Small Branches Group which is a group of small&nbsp; countries included in the Commonwealth, Women Steering Committee, Business Circle, CPA Executive Committee, and others. The above-mentioned issues were discussed elaborately in the meetings.</p>\r\n\r\n<p>Recommendations have come from these meetings which include legislating act to make the lawmakers free from corruption, active participation at least 30 percent women in active politics, border policies, expansion of bilateral and multilateral trades and commerce, and active participation of Commonwealth countries in the development of poor countries.</p>\r\n\r\n<p>The recommended proposals are now being dicussed in the main phase of the CPC. The international community thinks that the Commonwelth member-countries will get definite goal if the proposals are passed in the conference.</p>\r\n\r\n<p>Meanwhile, there is a possibility that a motion will be passed in the executive committee meeting on the basis of the recommendations that have come from the representatives of Commonwealth countries. The international leaders has pledged to stay beside Bangladesh on the ongoing Rohingya crisis and to discuss the matter in the national and provincial parliaments of their respective countries. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1509949484.jpg', 'boishakhi_1509949484.jpg', 'boishakhi_1509949484.jpg', 'boishakhi_1509949484.jpg', NULL, NULL, 3, 'CPC: Bangladesh gives special emphasis on Rohingya issue', 'CPC, Bangladesh, Rohigya crisis, 06 November 2017 news, ', 'Different significant issues including development of parliamentary democracy, poverty eradication and empowerment of women were given importance in the first phase of Commonwealth Parliamentary Conference (CPC', 35, 28, NULL, 0, 0, 1, 0, '06 November 2017 12:24:44', 'J Nandy', '06 November 2017 12:24:44', '2017-11-27 10:45:41', '2017-11-06 18:24:44'),
(18, 18, 'Supreme Court rejects Khaleda’s petition to change trial court', 'Zia Orphanage Trust graft case', '', '<p><strong>Staff Reporter:</strong> Supreme Court has rejected BNP chairperson Khaleda Zia&rsquo;s petition to change the trial court in the Zia Orphanage Trust graft case.</p>\r\n\r\n<p>&nbsp;\r\n<p>A five-member bench of the Appellate Division led by Acting Chief Justice Abdul Wahab Miah scrapped the BNP chief&rsquo;s plea today.</p>\r\n</p>\r\n\r\n<p>Earlier on Sunday, after concluding hearing, the apex court set Monday for delivering the verdict. The High Court on August 20 last scrapped Khaleda Zia&rsquo;s petition and added some observations on the matter.</p>\r\n\r\n<p>Meanwhile, the hearing of her plea on the same case regarding cross examination of 11 witnesses by state prosecutors has been completed. The verdict of the plea is set to be delivered on Thursday.</p>\r\n', '', 'boishakhi_1509951420.jpg', 'boishakhi_1509951420.jpg', 'boishakhi_1509951420.jpg', 'boishakhi_1509951420.jpg', NULL, NULL, 3, 'Supreme Court rejects Khaleda’s petition to change trial court', 'Supreme Court, Khaleda Zia, Zia Orphanage Trust graft case, 06 November 2017 news, ', 'Supreme Court has rejected BNP chairperson Khaleda Zia’s petition to change the trial court in the Zia Orphanage Trust graft case. A five-member bench of the Appellate Division led by Acting Chief Justice Abdul Wahab Miah scrapped the BNP chief’s plea today', 11, 27, NULL, 0, 0, 1, 0, '06 November 2017 12:57:00', 'J Nandy', '06 November 2017 12:57:00', '2017-11-27 10:45:41', '2017-11-06 18:57:00'),
(19, 18, 'University student stabbed to death in capital', '', '', '<p><strong>Crime Reporter:</strong> A student of a private university was stabbed to death in the capital&#39;s&rsquo;s Badda area following an altercation over betting on the ongoing Bangladesh Premier League (BPL).</p>\r\n\r\n<p>The victim named Nasim Ahmed was a BBA student of Manarat University, said police.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The relatives of the deceased said that Nasim became involved in a scuffle with a man named Ramjan last night. As a consequence, a youth stabbed Nasim and absconded in the morning today, the relatives claimed.</p>\r\n\r\n<p>Later Nasim in a serious condition was brought to Dhaka Medical College Hospital where the the on-duty doctor declared him as dead.</p>\r\n\r\n<p>The Officer-in-Charge of Badda police station said that the due action would be taken after scrutinizing the matter properly. &nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1509954537.jpg', 'boishakhi_1509954537.jpg', 'boishakhi_1509954537.jpg', 'boishakhi_1509954537.jpg', NULL, NULL, 3, 'University student stabbed to death in capital', 'Dhaka, Badda, student, murder, 06 November 2017 news, ', 'A student named Nasim of a private university has been stabbed to death by some miscreants at Badda area in the capital last night. The relatives of the deceased said that Nasim became involved in an altercation with a man named Ramjan last night', 12, 32, NULL, 0, 0, 1, 0, '06 November 2017 02:01:23', 'J Nandy', '06 November 2017 01:48:57', '2017-11-27 10:45:41', '2017-11-06 19:48:57'),
(20, 18, 'Militant nabbed in connection with Abhijit murder', '', '', '<p><strong>Crime Reporter:</strong> Counter Terrorism and Transnational Crime (CTTC)&nbsp; unit of police claimed to have arrested a suspected&nbsp; militant in connection with the murder of writer and blogger Abhijit Roy.</p>\r\n\r\n<p>The militant named Sohel alias Sakib was arrested from Mohammadpur area of the capital Sunday night.</p>\r\n\r\n<p>Police said, the arrestee is an active member of banned militant outfit of intelligence wing of Ansar Al-Islam.</p>\r\n\r\n<p>According to police, Sohel was directly involved in the killing of Abhijit. He was tracked down with the help of CCTV footage in the crime scene.</p>\r\n\r\n<p>Abhijit, founder of Mukto-Mona blog, was hacked to death at Dhaka University campus on February 26, 2015.</p>\r\n', '', 'boishakhi_1509956972.jpg', 'boishakhi_1509956972.jpg', 'boishakhi_1509956972.jpg', 'boishakhi_1509956972.jpg', NULL, NULL, 3, 'Militant nabbed in connection with Abhijit murder', 'Blogger Abhiji Roy murder, arrest, militant, 06 November 2017 news, ', 'Counter Terrorism and Transnational Crime (CTTC)  unit of police claimed to have arrested a suspected  militant in connection with the murder of writer and blogger Abhijit Roy', 8, 31, NULL, 0, 0, 1, 0, '06 November 2017 02:29:32', 'J Nandy', '06 November 2017 02:29:32', '2017-11-27 10:45:41', '2017-11-06 20:29:32'),
(21, 18, 'BNP to be strong opponent in next poll: Obaidul', '', '', '<p><strong>Cox&#39;s Bazar Correspondent:</strong> General Secretary of Awami League and Road Transport and Bridges Minister Obaidul Quader said, the next national election will be highly competitive as BNP is a strong opponent.</p>\r\n\r\n<p>The minister was speaking in a programme held on the occasion of recruitment and renewal of members in the district unit of Awami League.</p>\r\n\r\n<p>Obaidul said, though BNP is rather weak organisationally, but the party has a lot of public support. He called the Awami League leaders to mitigate the quarrel among themselves and not to undermine BNP&rsquo;s ability.</p>\r\n\r\n<p>He also commented that the young voters are going to be one of the major forces of Awami League in the next election. &nbsp;</p>\r\n', '', 'boishakhi_1509959697.jpg', 'boishakhi_1509959697.jpg', 'boishakhi_1509959697.jpg', 'boishakhi_1509959697.jpg', NULL, NULL, 3, 'BNP to be strong opponent in next poll: Obaidul', 'Obaidul Quader, Awami League, BNP, Cox\'s Bazar, 06 November 2017 news, ', 'General Secretary of Awami League and Road Transport and Bridges Minister Obaidul Quader said, the next national election will be highly competitive as BNP is a strong opponent', 9, 29, NULL, 0, 0, 1, 0, '06 November 2017 03:18:37', 'J Nandy', '06 November 2017 03:14:57', '2017-11-27 10:45:41', '2017-11-06 21:14:57');
