(22, 18, 'US envoy Shannon meets Khaleda Zia', '', '', '<p><strong>Staff Reporter:</strong> Visiting US Under-Secretary of State for Political Affairs Thomas A. Shannon along with 5 delegation members met with BNP Chairperson Khaleda Zia at her Gulshan office on Monday.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The meeting started at 10:45am and continued for 45 minutes. Various issues relating to mutual interests of the two countries, Rohingya crisis and Bangladesh&rsquo;s latest political situation came up for discussion at the meeting.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Talking to newsmen after the meeting, Secretary General of the party Mirza Fakhrul Islam Alamgir said, Khaleda Zia held a successful meeting with Shannon.</p>\r\n', '', 'boishakhi_1509961620.jpg', 'boishakhi_1509961620.jpg', 'boishakhi_1509961620.jpg', 'boishakhi_1509961620.jpg', NULL, NULL, 3, 'US envoy Shannon meets Khaleda Zia', ' Thomas A Shannon, US Under-Secretary, Khaleda Zia, BNP Chairperson, 06 November 2017 news, ', 'Visiting US Under-Secretary of State for Political Affairs Thomas A Shannon along with 5 delegation members met with BNP Chairperson Khaleda Zia at her Gulshan office on Monday', 25, 30, NULL, 0, 0, 1, 0, '06 November 2017 03:47:37', 'J Nandy', '06 November 2017 03:47:00', '2017-11-27 10:45:41', '2017-11-06 21:47:00'),
(23, 18, 'Trump lands in Seoul in second leg of 12-day Asia trip\r\n\r\n\r\n', '', '', '<p><strong>International Desk:</strong> U.S. President Donald Trump landed in South Korea on Tuesday, the second leg of his 12-day Asia trip dominated by the North Korean nuclear standoff, reports Reuters.</p>\r\n\r\n<p>President Trump and first lady Melania board Air Force One as they depart for Seoul, at U.S. Air Force Yokota base in Fussa, on the outskirts of Tokyo, Japan, November 7, 2017.</p>\r\n\r\n<p>South Koreans are bracing for the possibility that Trump&rsquo;s state visit could risk further inflaming tensions with North Korean leader Kim Jong Un, who has stepped up his pursuit of nuclear weapons that could soon be capable of striking the mainland United States.</p>\r\n\r\n<p>Trump will visit with U.S troops and is also expected to raise criticisms of a U.S-South Korean trade pact when he meets with President Moon Jae-in in Seoul.</p>\r\n', '', 'boishakhi_1510029709.jpg', 'boishakhi_1510029709.jpg', 'boishakhi_1510029709.jpg', 'boishakhi_1510029709.jpg', NULL, NULL, 3, 'Trump lands in Seoul in second leg of 12-day Asia tour', 'Donald Trump, US President, South Korea, Asia tour, 07 November 2017 news, ', 'U.S. President Donald Trump landed in South Korea on Tuesday, the second leg of his 12-day Asia trip dominated by the North Korean nuclear standoff, reports Reuters. President Trump and first lady Melania board Air Force One', 12, 20, NULL, 0, 0, 1, 0, '07 November 2017 10:47:46', 'J Nandy', '07 November 2017 10:41:49', '2017-11-27 10:45:41', '2017-11-07 16:41:49'),
(24, 18, 'UN urges Myanmar to stop excessive military operation in Rakhine', '', '', '<p><strong>International Desk:</strong> The United Nations (UN) Security Council urged the Myanmar government on Monday to &ldquo;ensure no further excessive use of military force in Rakhine state,&rdquo; where violence has forced more than 600,000 Rohingya Muslims to flee the Buddhist-majority Asian country.</p>\r\n\r\n<p>The UN has denounced the violence during the past 10 weeks as a classic example of ethnic cleansing. The Myanmar government has denied allegations of ethnic cleansing, reports Reuters.</p>\r\n\r\n<p>To appease council veto powers Russia and China, Britain and France dropped a push for the Security Council to adopt a resolution on the situation and the 15-member body instead unanimously agreed on a formal statement.</p>\r\n\r\n<p>The council expressed &ldquo;grave concern over reports of human rights violations and abuses in Rakhine State, including by the Myanmar security forces, in particular against persons belonging to the Rohingya community.&rdquo;</p>\r\n\r\n<p>&ldquo;The Security Council calls upon the Government of Myanmar to ensure no further excessive use of military force in Rakhine State, to restore civilian administration and apply the rule of law, and to take immediate steps in accordance with their obligations and commitments to respect human rights,&rdquo; it said.</p>\r\n\r\n<p>Myanmar has been stung by international criticism for the way its security forces responded to attacks by Rohingya militants on 30 security posts. More than 600,000 Rohingya have fled to Bangladesh since Aug. 25.</p>\r\n\r\n<p>A Rohingya refugee carrying a child walks along the Kutupalong refugee camp, near Cox&#39;s Bazar, Bangladesh November 7, 2017. REUTERS/Navesh Chitrakar</p>\r\n\r\n<p>&ldquo;The Security Council stresses the primary responsibility of the Government of Myanmar to protect its population including through respect for the rule of law and the respect, promotion and protection of human rights,&rdquo; the statement said.</p>\r\n\r\n<p>It stressed the importance of transparent investigations into allegations of human rights abuses and &ldquo;in this regard, the Security Council calls upon the Government of Myanmar to cooperate with all relevant United Nations&nbsp;bodies, mechanisms and instruments.&rdquo;</p>\r\n\r\n<p>Myanmar has refused entry to a U.N. panel that was tasked with investigating allegations of abuses after a smaller military counteroffensive launched in October 2016.</p>\r\n\r\n<p>Myanmar&rsquo;s de facto leader, Aung San Suu Kyi, has pledged accountability for rights abuses and says Myanmar will accept back refugees who can prove they were residents of Myanmar.</p>\r\n\r\n<p>The Security Council said it was alarmed by the rapidly deteriorating humanitarian situation in Rakhine state and warned that the increasing number of refugees &ldquo;has a destabilizing impact in the region.&rdquo;</p>\r\n\r\n<p>The council demanded that the Myanmar government allow immediate, safe and unhindered humanitarian aid and media access. It asked U.N. Secretary-General Antonio Guterres to report back in 30 days on the situation.</p>\r\n', '', 'boishakhi_1510030859.jpg', 'boishakhi_1510030859.jpg', 'boishakhi_1510030859.jpg', 'boishakhi_1510030859.jpg', NULL, NULL, 3, 'UN urges Myanmar to stop excessive military operation in Rakhine', 'United Nations, Myanmar, Rakhine state, 07 November 2017 news, ', 'The United Nations (UN) Security Council urged the Myanmar government on Monday to “ensure no further excessive use of military force in Rakhine state,” where violence has forced more than 600,000 Rohingya Muslims to flee the Buddhist-majority Asian country', 19, 17, NULL, 0, 0, 1, 0, '07 November 2017 11:33:27', 'J Nandy', '07 November 2017 11:00:59', '2017-11-27 10:45:41', '2017-11-07 17:00:59'),
(25, 18, 'Mobile court detains 26 persons in Cox\'s Bazar', 'Suspicious movements in Rohingya camps', '', '<p><strong>Cox&rsquo;s Bazar Correspondent:</strong> 26 persons were detained by mobile court for their suspicious movements in the Rohingya camps of Cox&rsquo;s Bazar. They were nabbed from Kutupalong and Balukhali camps in the district from 8pm to midnight yesterday.</p>\r\n\r\n<p>The detainees include one Chinese, 4 British and 21 Bangladeshi nationals. But the 4 foreigners were released later by taking bonds from them. On the other hand, 10 among the Bangladeshishave been awarded with different punishments.</p>\r\n\r\n<p>Mohammad Nikaruzzaman, the UNO of Ukhiya, said it is prohibited to stay in the camps from 6am to 6pm.</p>\r\n', '', 'boishakhi_1510032417.jpg', 'boishakhi_1510032417.jpg', 'boishakhi_1510032417.jpg', 'boishakhi_1510032417.jpg', NULL, NULL, 3, 'Mobile court detains 26 persons in Cox\'s Bazar', 'Cox\'s Bazar, Rohingya Camps, detainment, 07 November 2017 news, ', '26 persons were detained by mobile court for their suspicious movements in the Rohingya camps of Cox’s Bazar. They were nabbed from Kutupalong and Balukhali camps in the district from 8pm to midnight yesterday', 12, 18, NULL, 0, 0, 1, 0, '07 November 2017 11:27:19', 'J Nandy', '07 November 2017 11:26:57', '2017-11-27 10:45:41', '2017-11-07 17:26:57'),
(26, 18, 'Saudi anti-corruption drive widens with arrests and no-fly list', '', '', '<div>\r\n<p><strong>International Desk:</strong> Saudi Arabia&#39;s anti-corruption purge has widened after one of the country&#39;s top businessmen was reportedly detained, accounts were frozen and a no-fly list was drawn up.</p>\r\n\r\n<p>On Monday, Nasser bin Aqeel al-Tayyar, a board member at Saudi Arabia&#39;s biggest travel company, was reportedly added to the list detainees, which already included some of the country&#39;s most influential officials and entrepreneurs.</p>\r\n\r\n<p>Among those detained are 11 princes, four ministers and several former ministers, in what is seen as an unprecedented crackdown that has shaken the kingdom, reports Al Jazeera.</p>\r\n\r\n<p>The dramatic steps were the latest in a series of measures by Crown Prince Mohammed bin Salman to assert power over the country and its previous leaders.</p>\r\n\r\n<p>On Saturday, King Salman bin Abdulaziz Al Saud announced that his son, the crown prince, would oversee a newly formed anti-graft commission that would purge the country of corruption.</p>\r\n\r\n<p>In a statement via the Saudi Center of International Communication, Khalid bin Abdulmohsen Al-Mehaisen, president of the anti-corruption commission, said: &quot;The evidence of transgressions and financial mismanagement uncovered recently points to widespread corruption in a number of cases.</p>\r\n\r\n<p>&quot;The responsibility of the new anti-corruption committee is to ensure that investigations into those cases are completed, and that the full force of the law is applied,&quot; Mehaisen said.</p>\r\n\r\n<p>Attorney General Sheikh Saud al-Mojeb said that the purge was only &quot;phase one&quot; and that detainees had been questioned.</p>\r\n\r\n<p>&quot;Yesterday [Saturday] does not represent the start, but the completion of Phase One of our anti-corruption push,&quot; Mojeb said, adding that investigations were done discreetly &quot;in order to preserve the integrity of the legal proceedings and ensure there was no flight from justice&quot;.</p>\r\n\r\n<p>Prince Alwaleed bin Talal, a billionaire businessman who owns investment firm Kingdom Holding was among those held, according to Reuters news agency, citing an unnamed senior official.</p>\r\n\r\n<p>The list of detainees also included senior ministers who were recently sacked, such as Prince Mitaab bin Abdullah, the head of the National Guard, and Adel Faqih, the economy minister.</p>\r\n\r\n<p>On Monday, stock in Al Tayyar Travel was down 10 percent in the opening minutes at Saudi Arabia&#39;s stock index after media reported the detention of Tayyar.</p>\r\n\r\n<p>Meanwhile, Saudi banks reportedly started freezing bank accounts of the suspects.</p>\r\n\r\n<p>&quot;The committee has the authority to reveal the bank details of the accused, freeze their assets and funds, and take other appropriate measures,&quot; anti-corruption commission president, Mehaisen, said.</p>\r\n\r\n<p>&quot;However, it will ensure that no wrongdoer is able to escape punishment, regardless of their position and status, while at the same time doing everything to protect the innocent. As Crown Prince Mohammed bin Salman has stated clearly, no one is above the law, and no one who is proven to have indulged in corruption will escape, not even a prince or a minister.&quot;</p>\r\n\r\n<p>Pan-Arab daily Al-Asharq Al-Awsat reported that a no-fly list has been issued and that security forces in several Saudi airports were ordered to bar private jets owners from taking off without a permit.</p>\r\n\r\n<p>&quot;Security members were seen in the lounges of private jets to monitor the situation and to make sure that no plane leaves the kingdom without a permit,&quot; the newspaper reported, citing unnamed sources, adding that security personnel were given a list of specific names of individuals who should be prevented from leaving.</p>\r\n\r\n<p>The shake-up of the Saudi government comes just months after King Salman replaced his nephew Mohammed bin Nayef with his son Mohammed as the kingdom&#39;s crown prince.</p>\r\n\r\n<p>Mohammed bin Salman has been responsible for pushing through a number of changes both at home and abroad since he became first in line to the Saudi crown.</p>\r\n</div>\r\n', '', 'boishakhi_1510034213.jpg', 'boishakhi_1510034213.jpg', 'boishakhi_1510034213.jpg', 'boishakhi_1510034213.jpg', NULL, NULL, 3, 'Saudi anti-corruption drive widens with arrests and no-fly list', 'Saudi Arabia, anti-corruption purge, arrests, 07 November 2017 news, ', 'Saudi Arabia\'s anti-corruption purge has widened after one of the country\'s top businessmen was reportedly detained, accounts were frozen and a no-fly list was drawn up. On Monday, Nasser bin Aqeel al-Tayyar', 20, 22, NULL, 0, 0, 1, 0, '07 November 2017 11:56:53', 'J Nandy', '07 November 2017 11:56:53', '2017-11-27 10:45:41', '2017-11-07 17:56:54'),
(27, 18, '4 workers killed while extracting stone in Sylhet', '', '', '<p><strong>Sylhet Correspondent:</strong> At least four workers were killed and two others injured following landslide while extracting stone illegally at Banglatila area of Kanaighat in Sylhet on Tuesday. Two more went in missing in the mishap.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bangla Tila area is a remote area. This morning, a hole created for stone extraction collapsed and buried some workers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The identities of the deceased could not be ascertained immediately</p>\r\n\r\n<p>Locals said, the accident took place in the morning during the extraction of stone. On information, police reached the spot and conducted rescue operation with the assistance of the locals.</p>\r\n', '', 'boishakhi_1510035893.jpg', 'boishakhi_1510035893.jpg', 'boishakhi_1510035893.jpg', 'boishakhi_1510035893.jpg', NULL, NULL, 3, '4 workers killed while extracting stone in Sylhet', 'Sylhet, stone querry, workers killed, 07 November 2017 news, ', 'At least four workers were killed and two others injured following landslide while extracting stone illegally at Banglatila area of Kanaighat in Sylhet on Tuesday. Two more went in missing in the mishap. Bangla Tila area is a remote area', 10, 21, NULL, 0, 0, 1, 0, '07 November 2017 12:25:18', 'J Nandy', '07 November 2017 12:24:53', '2017-11-27 10:45:41', '2017-11-07 18:24:53'),
(28, 18, 'Paradise Papers leaks Apple\'s secret tax escapes', '', '', '<p><strong>International Desk:</strong> The world&#39;s most profitable firm has a secretive new structure that would enable it to continue avoiding billions in taxes, the Paradise Papers show.</p>\r\n\r\n<p>They reveal how Apple sidestepped a 2013 crackdown on its controversial Irish tax practices by actively shopping around for a tax haven, reports BBC.</p>\r\n\r\n<p>It then moved the firm holding most of its untaxed offshore cash, now $252bn, to the Channel Island of Jersey.</p>\r\n\r\n<p>Apple said the new structure had not lowered its taxes.</p>\r\n\r\n<p>It said it remained the world&#39;s largest taxpayer, paying about $35bn (&pound;26bn) in corporation tax over the past three years, that it had followed the law and its changes &quot;did not reduce our tax payments in any country&quot;.</p>\r\n\r\n<p>In a further statement the company stressed that no operations or investments had been moved from Ireland.</p>\r\n\r\n<p>The Paradise Papers is the name for a huge leak of financial documents that is throwing light on the world of offshore finance.</p>\r\n\r\n<p>Up until 2014, the tech company had been exploiting a loophole in tax laws in the US and the Republic of Ireland known as the &quot;double Irish&quot;.</p>\r\n\r\n<p>This allowed Apple to funnel all its sales outside of the Americas - currently about 55% of its revenue - through Irish subsidiaries that were effectively stateless for taxation purposes, and so incurred hardly any tax.</p>\r\n\r\n<p>Instead of paying Irish corporation tax of 12.5%, or the US rate of 35%, Apple&#39;s avoidance structure helped it reduce its tax rate on profits outside of the US to the extent that its foreign tax payments rarely amounted to more than 5% of its foreign profits, and in some years dipped below 2%.</p>\r\n\r\n<p>The European Commission calculated the rate of tax for one of Apple&#39;s Irish companies for one year had been just 0.005%.</p>\r\n\r\n<p>Apple came under pressure in 2013 in the US Senate, when CEO Tim Cook was forced to defend its tax system.</p>\r\n\r\n<p>Angry that the US was missing out on a huge amount of tax, then-Senator Carl Levin told him: &quot;You shifted that golden goose to Ireland. You shifted it to three companies that do not pay taxes in Ireland. These are the crown jewels of Apple Inc. Folks, it&#39;s not right.&quot;</p>\r\n\r\n<p>Cook responded defiantly: &quot;We pay all the taxes we owe, every single dollar. We do not depend on tax gimmicks... We do not stash money on some Caribbean island.&quot;</p>\r\n', '', 'boishakhi_1510037266.jpg', 'boishakhi_1510037266.jpg', 'boishakhi_1510037266.jpg', 'boishakhi_1510037266.jpg', NULL, NULL, 3, 'Paradise Papers leaks Apple\'s secret tax escapes', 'Paradise Papers leak, Apple, tax evasion, 07 November 2017 news, ', 'The world\'s most profitable firm has a secretive new structure that would enable it to continue avoiding billions in taxes, the Paradise Papers show. They reveal how Apple sidestepped a 2013 crackdown on its controversial Irish tax practices', 19, 23, NULL, 0, 0, 1, 0, '07 November 2017 12:47:46', 'J Nandy', '07 November 2017 12:47:46', '2017-11-27 10:45:41', '2017-11-07 18:47:46'),
(29, 18, 'Another Saudi prince dies within 24 hours\r\n\r\n\r\n', 'Reason for the death not yet disclosed', '', '<p><strong>International Desk:</strong> Hours after the death of Mansour Bin Muqrin, son of former crown prince Muqrin al-Saud, Twitter is abuzz with the reports of death of yet another Saudi prince.</p>\r\n\r\n<p>The ArabicAlIthad News later quoted a Saudi Royal Court release saying that the Saudi royal family mourned the death of the prince who died at 44. It however did not cite a reason for the death.</p>\r\n\r\n<p>Prince Aziz (44) was the youngest son of King Fahd and was reportedly arrested on Sunday.</p>\r\n\r\n<p>The news of the arrest and a subsequent gunfight came from various sources and earlier reports suggested that Abdul Aziz was hospitalised. The al-Masdar news network first reported the news of his death and later removed it.</p>\r\n\r\n<p>The rumours of death began doing the rounds after few verified accounts broke the news.</p>\r\n\r\n<p>Meanwhile, other reports said that Aziz was killed in a gunfight while allegedly resisting arrest.</p>\r\n\r\n<p>A report on TheDuran website however did not mention a gunfight but only said &#39;died during an attempted arrest&#39;.</p>\r\n\r\n<p>A Saudi prince has died in a helicopter crash near the border of Yemen on Sunday afternoon.</p>\r\n\r\n<p>Prince Mansour Bin Muqrin, a member of the House of Saud and son of former crown prince Prince Muqrin al-Saud, was the appointed Advisor to the Custodian of the Two Holy Mosques.</p>\r\n\r\n<p>Mansour Bin Muqrin was also the governor of Asir, a southern province in Saudi Arabia. Muqrin was traveling with several other government officials who were also killed in the crash, state TV Ekhbariya reported.</p>\r\n\r\n<p>The helicopter crash came after Saudi Arabia arrested nearly a dozen princes, and several other former and current officials in a crackdown by the government&#39;s new anti-corruption committee on Saturday night.</p>\r\n\r\n<p>Among those arrested is Alwaleed bin Talal, one of the richest people on the planet and a major investor in marquee brands of the world.</p>\r\n', '', 'boishakhi_1510038705.jpg', 'boishakhi_1510038705.jpg', 'boishakhi_1510038705.jpg', 'boishakhi_1510038705.jpg', NULL, NULL, 3, 'Another Saudi prince dies within 24 hours', 'Saudi prince, death, 07 November 2017 news, ', 'Hours after the death of Mansour Bin Muqrin, son of former crown prince Muqrin al-Saud, Twitter is abuzz with the reports of death of yet another Saudi prince.\r\nThe ArabicAlIthad News later quoted', 21, 19, NULL, 0, 0, 1, 0, '07 November 2017 01:11:45', 'J Nandy', '07 November 2017 01:11:45', '2017-11-27 10:45:41', '2017-11-07 19:11:45'),
(30, 18, 'BPL: Chittagong-Comilla and Sylhet-Rajshahi matches today', '', '', '<p><strong>Sports Reporter:</strong> Two matches will be held in Bangladesh Premier League (BPL) Cricket Tournament on Tuesday.</p>\r\n\r\n<p>In the first match of the day to be held in Sylhet International Cricket Stadium at 2am, Chittagong Vikings will face Comilla Victorians.</p>\r\n\r\n<p>Chittagong likes to start its participation in the fifth BPL with a victory. On the other hand, Comilla also wants to bag its first win in the tournament after they were beaten in the first by Sylhet.</p>\r\n\r\n<p>In the second match of the day to be started at 6pm, Sylhet Sixers will take on Rajshahi Kings.</p>\r\n\r\n<p>Sylhet Sixers is now at the top of the point table with two succesive wins. They now aim to continue their winning spree. On the contrary, Rajshahi lost their first match toRangpur Riders, and so they wish to have a good victory in their second one. &nbsp;</p>\r\n', '', 'boishakhi_1510039581.jpg', 'boishakhi_1510039581.jpg', 'boishakhi_1510039581.jpg', 'boishakhi_1510039581.jpg', NULL, NULL, 3, 'BPL: Chittagong-Comilla and Sylhet-Rajshahi matches today', 'Bangladesh Premier League, BPL, cricket, 07 November 2017 news, ', 'Two matches will be held in Bangladesh Premier League (BPL) Cricket Tournament on Tuesday. In the first match of the day to be held in Sylhet International Cricket Stadium at 2am, Chittagong Vikings will face Comilla Victorians', 77, 24, NULL, 0, 0, 1, 0, '07 November 2017 01:39:38', 'J Nandy', '07 November 2017 01:26:21', '2017-11-27 10:45:41', '2017-11-07 19:26:22'),
(31, 18, '63rd CPC ends today', 'Emphasis on strenthening relation of Commonwelth countries', '', '<p><strong>Staff Reporter:</strong> CPC 2017, the parliamentary conference of Commonwealth member countries is oing to be concluded today. It will be ended after electing next president of Commonwealth Parliamentary Association (CPA) and passing the CPC resolution.</p>\r\n\r\n<p>Meanwhile, the representatives of different Commonwealth countries said the parliamentary democratic system should be strengthened in their respective countries by implementing &nbsp;the resolutions taken in the conference. In this regard, they also gave emphasis on enhancing inter-state relations among Commonwealth countries.</p>\r\n\r\n<p>In the morning of the last day of 63<sup>rd</sup> Commonwealth Parliamentary Conference (CPC) on Tuesday, the representatives of Commonwealth countries are taking part in a meeting to elect the next chairperson of CPA. CPA&rsquo;s working plan of the next year has also been discussed in the meeting.</p>\r\n\r\n<p>Keeping this year&rsquo;s slogan of CPC in mind, the speakers also have given emphasis to the development of parliamentary democratic system and active participation of women in politics.</p>\r\n\r\n<p>The representatives have expressed their opinion that the the inter-state communication has to be strengthened in order to implement the resolutions taken in the CPA conference.</p>\r\n\r\n<p>They called the rich countries of commonwealth to come forward to help the development of their poor counterparts.</p>\r\n', '', 'boishakhi_1510044137.jpg', 'boishakhi_1510044137.jpg', 'boishakhi_1510044137.jpg', 'boishakhi_1510044137.jpg', NULL, NULL, 3, '63rd CPC ends today', 'CPC, CPA, Dhaka, 07 November 2017 news, ', 'CPC 2017, the parliamentary conference of Commonwealth member countries is oing to be concluded today. It will be ended after electing next president of Commonwealth Parliamentary Association (CPA) and passing the CPC resolution', 52, 112, NULL, 0, 0, 1, 0, '08 November 2017 04:51:47', 'J Nandy', '07 November 2017 02:42:17', '2017-11-27 10:45:41', '2017-11-07 20:42:17'),
(32, 18, 'Navy being modernised in continuation of development', 'President says while commissioning new ships', '', '<p><strong>Khulna Correspondent:</strong> President Mohammad Abdul Hamid has commissioned 4 warships built in Khulna shipyard. At that time he said, these new ships will bring more speed in the professionalism of Bangladesh Navy.</p>\r\n\r\n<p>&nbsp;\r\n<p>The Navy has to play a true professional role in protecting long maritime boundary and collecting marine resources, the President commented. The vessels commissioned by the President are battleships &lsquo;BNS Durgam&rsquo; and &lsquo;BNS Nishan&rsquo; and submarine operation tug boats to the sailors of the vessels.</p>\r\n</p>\r\n\r\n<p>In the commissioning programme Abdul Hamid said, the navy is being modernised in a continuation of the country&rsquo;s development. Bangladesh Navy has turned to be a three-dimensional force with the progress of time, he concluded.</p>\r\n', '', 'boishakhi_1510133251.jpg', 'boishakhi_1510133251.jpg', 'boishakhi_1510133251.jpg', 'boishakhi_1510133251.jpg', NULL, NULL, 3, 'Navy being modernised in continuation of development', 'President Abdul Hamid, Bangladesh Navy, Khulna, 08 November 2017 news, ', 'President Mohammad Abdul Hamid has commissioned 4 warships built in Khulna shipyard. At that time he said, these new ships will bring more speed in the professionalism of Bangladesh Navy', 29, 12, NULL, 0, 0, 1, 0, '08 November 2017 03:27:31', 'J Nandy', '08 November 2017 03:27:31', '2017-11-27 10:45:41', '2017-11-08 21:27:31'),
(33, 18, 'HRW urges to put pressure on Myanmar to end Rohingya crisis', '', '', '<p><strong>International Desk:</strong> Human Rights Watch (HRW) has urged international community to put pressure on Myanmar to put an end to the persecution on Rohingyas and to create safe environment for their repatriation.</p>\r\n\r\n<p>HRW made the urge in a statement on Tuesday. According to the statement, the issue will be tabled in the APEC and ASEAN summit which are scheduled to be held in this month.</p>\r\n\r\n<p>Meanwhile, a spokesman of UN High Commission for Refugees (UNHCR) said, one-third of Rohingyas, who took shelters in Bangladesh are at risk of severe health crisis.</p>\r\n\r\n<p>On the other hand, Myanmar said that the UN Security Council&#39;s statement on the Rohingya refugee crisis could seriously harm its dialogue with Bangladesh over Rohingya repatriation in Myanmar.</p>\r\n', '', 'boishakhi_1510134039.jpg', 'boishakhi_1510134039.jpg', 'boishakhi_1510134039.jpg', 'boishakhi_1510134039.jpg', NULL, NULL, 3, 'HRW urges to put pressure on Myanmar to end Rohingya crisis', 'Human Rights Watch, Myanmar, Rohingyas, 08 November 2017 news, ', 'Human Rights Watch (HRW) has urged international community to put pressure on Myanmar to put an end to the persecution on Rohingyas and to create safe environment for their repatriation', 36, 13, NULL, 0, 0, 1, 0, '08 November 2017 04:16:22', 'J Nandy', '08 November 2017 03:40:39', '2017-11-27 10:45:41', '2017-11-08 21:40:39'),
(34, 18, 'RAB starts drives to stop selling of SIM cards to Rohingyas', '', '', '<p><strong>Cox&#39;s Bazar Correspondent:</strong> RAB has started drives to stop the selling of SIM cards to the Rohingyas taken shelter in Bangladesh.</p>\r\n\r\n<p>On Tuesday, 5 Rohingyas were detained from Kutupalong of Cox&rsquo;s Bazar. Later, mobile court handed down jail term of six months to each of them.</p>\r\n\r\n<p>Earlier on September 23, the government warned all the mobile operators of legal action if they are caught selling SIM cards to the sheltered people.</p>\r\n', '', 'boishakhi_1510136831.jpg', 'boishakhi_1510136831.jpg', 'boishakhi_1510136831.jpg', 'boishakhi_1510136831.jpg', NULL, NULL, 3, 'RAB starts drives to stop selling of SIM cards to Rohingyas', 'Cox.s Bazar, Rohingyas, SIM card, RAB, 08 November 2017 news, ', 'RAB has started drives to stop the selling of SIM cards to the Rohingyas taken shelter in Bangladesh. On Tuesday, 5 Rohingyas were detained from Kutupalong of Cox’s Bazar', 16, 14, NULL, 0, 0, 1, 0, '08 November 2017 04:29:04', 'J Nandy', '08 November 2017 04:27:11', '2017-11-27 10:45:41', '2017-11-08 22:27:11'),
(35, 18, 'Vow to work together to implement proposals adopted in CPA ', '', '', '<p><strong>Staff Reporter:</strong> Representatives of different member-countries of the Commonwealth who participated in Commonwealth Parliamentary Association (CPA) conference vowed to work together to implement adopted proposals.</p>\r\n\r\n<p>&nbsp;\r\n<p>Representatives adopted 8-point proposals including empowerment of women, reducing gender discrimination and attaining sustainable development goals.</p>\r\n</p>\r\n\r\n<p>In this regard, participants opined that there are weaknesses in the proposals and they also expressed doubt over the implementation of them. But international representatives urged for taking effective initiatives to accomplish all the adopted proposals.</p>\r\n\r\n<p>They further stressed the need for strengthening inter-states relationship to properly implement the adopted resolution.</p>\r\n\r\n<p>Apart from this, participated representatives adopted a consensus to work unitedly aiming to resolve longstanding Rohingya crisis.&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1510138268.jpg', 'boishakhi_1510138268.jpg', 'boishakhi_1510138268.jpg', 'boishakhi_1510138268.jpg', NULL, NULL, 3, 'Vow to work together to implement proposals adopted in CPA', 'Commonwealth Parliamentary Association, CPA conference, 08 November 2017 news, ', 'Representatives of different member-countries of the Commonwealth who participated in Commonwealth Parliamentary Association (CPA) conference vowed to work together to implement adopted proposals', 12, 16, NULL, 0, 0, 1, 0, '08 November 2017 04:51:08', 'J Nandy', '08 November 2017 04:51:08', '2017-11-27 10:45:41', '2017-11-08 22:51:08'),
(36, 18, 'Vow to work together to implement proposals adopted in CPA ', '', '', '<p><strong>Staff Reporter:</strong> Representatives of different member-countries of the Commonwealth who participated in Commonwealth Parliamentary Association (CPA) conference vowed to work together to implement adopted proposals.</p>\r\n\r\n<p>&nbsp;\r\n<p>Representatives adopted 8-point proposals including empowerment of women, reducing gender discrimination and attaining sustainable development goals.</p>\r\n</p>\r\n\r\n<p>In this regard, participants opined that there are weaknesses in the proposals and they also expressed doubt over the implementation of them. But international representatives urged for taking effective initiatives to accomplish all the adopted proposals.</p>\r\n\r\n<p>They further stressed the need for strengthening inter-states relationship to properly implement the adopted resolution.</p>\r\n\r\n<p>Apart from this, participated representatives adopted a consensus to work unitedly aiming to resolve longstanding Rohingya crisis.&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1510138276.jpg', 'boishakhi_1510138276.jpg', 'boishakhi_1510138276.jpg', 'boishakhi_1510138276.jpg', NULL, NULL, 3, 'Vow to work together to implement proposals adopted in CPA', 'Commonwealth Parliamentary Association, CPA conference, 08 November 2017 news, ', 'Representatives of different member-countries of the Commonwealth who participated in Commonwealth Parliamentary Association (CPA) conference vowed to work together to implement adopted proposals', 10, 15, NULL, 0, 0, 1, 0, '08 November 2017 04:51:16', 'J Nandy', '08 November 2017 04:51:16', '2017-11-27 10:45:41', '2017-11-08 22:51:16'),
(37, 18, 'Trump and Xi Jinping express different visions in APEC Summit ', 'US President praises Modi and India', '', '<p><strong>International Desk:</strong> US President Donald Trump and his Chinese counterpart Xi Jinping have set out starkly different visions for the future of global trade in speeches at a summit in Vietnam.</p>\r\n\r\n<p>In a defiant address, Trump told the Asia-Pacific Economic Co-operation (APEC) meeting that the US would no longer tolerate chronic trade abuses. In contrast, President Xi said globalisation was irreversible. Trump is currently on a five-nation Asia tour, with China one of his stops.</p>\r\n\r\n<p>Meanwhile, Trump on Saturday praised India&#39;s astounding growth after it opened its economy and also Prime Minister Narendra Modi, saying he has been working successfully to bring the vast country and its people together.</p>\r\n\r\n<p>Speaking at a gathering of CEOs on the sidelines of the APEC&nbsp;summit, President Trump said that countries outside of the grouping were also making great strides in this new chapter for the Indo-Pacific.</p>\r\n\r\n<p>Indian Prime Minister&nbsp;is leaving for the Philippines on Sunday to attend the India-ASEAN and East Asia summits. President Trump is also scheduled to attend the East Asia Summit, a key meeting between ASEAN and eight of its partners.</p>\r\n', '', 'boishakhi_1510370582.jpg', 'boishakhi_1510370582.jpg', 'boishakhi_1510370582.jpg', 'boishakhi_1510370582.jpg', NULL, NULL, 3, '', 'US President Donald Trump, Chinese President Xi Jinping, APEC summit, 11 November 2017 news, ', 'US President Donald Trump and his Chinese counterpart Xi Jinping have set out starkly different visions for the future of global trade in speeches at a summit in Vietnam. In a defiant address, Trump told the Asia-Pacific Economic Co-operation (APEC)', 10, 7, NULL, 0, 0, 1, 0, '11 November 2017 09:23:02', 'J Nandy', '11 November 2017 09:23:02', '2017-11-27 10:45:41', '2017-11-11 15:23:03'),
(38, 18, 'Road mishap kill 2 in Narayanganj', '3 others injured', '', '<p><strong>Narayanganj Correspondent:</strong> Two persons have been killed and three others injured when a private car collided over with a goods laden lorry at Bandar area in Narayanganj.</p>\r\n\r\n<p>The mishap took place on Dhaka-Chittagong Highway at Kaodhala area of the sub-district last night.</p>\r\n\r\n<p>Kanchpur Highway Police Station sources said, the ill-fated private car hit the backside of the lorry while it was heading for Dhaka in a high speed.</p>\r\n\r\n<p>The two died on the spot. The injured were rescued and sent to Dhaka Medical College Hospital.&nbsp;</p>\r\n', '', 'boishakhi_1510371452.jpg', 'boishakhi_1510371452.jpg', 'boishakhi_1510371452.jpg', 'boishakhi_1510371452.jpg', NULL, NULL, 3, 'Road mishap kill 2 in Narayanganj', 'Road Accident, Narayanganj, killed, 11 November 2017 news, ', 'Two persons have been killed and three others injured when a private car collided over with a goods laden lorry at Bandar area in Narayanganj. The mishap took place on Dhaka-Chittagong Highway at Kaodhala area of the sub-district last night', 9, 10, NULL, 0, 0, 1, 0, '11 November 2017 09:37:32', 'J Nandy', '11 November 2017 09:37:32', '2017-11-27 10:45:41', '2017-11-11 15:37:32'),
(39, 18, 'Lebanese Hezbollah leader accuses Riyadh of declaring war', 'Also blames Saudi of holding Hariri against his will', '', '<p><strong>International Desk:</strong> The leader of Lebanon&#39;s Hezbollah has accused Saudi Arabia of declaring war on his country, days after Lebanese PM Saad al-Hariri announced his resignation in the Saudi capital.</p>\r\n\r\n<p>Hassan Nasrallah said Saudi Arabia was holding Hariri against his will, reports BBC.</p>\r\n\r\n<p>He also accused the Saudis of inciting Israel against Lebanon.</p>\r\n\r\n<p>The powerful Hezbollah Shia movement is an ally of Iran, which has been trading accusations with the Saudis of fuelling tension in Lebanon and the region.</p>\r\n\r\n<p>Hariri said in a TV broadcast from Riyadh on Saturday he was stepping down because of an unspecified threat to his life. He also attacked Hezbollah and Iran.</p>\r\n\r\n<p>However, Lebanese President Michel Aoun and other senior politicians have demanded his return, amid suspicions that he is being held by the Saudis under house arrest and forced to do their bidding.</p>\r\n\r\n<p>Aoun has not accepted Mr Hariri&#39;s resignation.</p>\r\n\r\n<p>Hariri has still not spoken publicly since his announcement.</p>\r\n', '', 'boishakhi_1510372369.jpg', 'boishakhi_1510372369.jpg', 'boishakhi_1510372369.jpg', 'boishakhi_1510372369.jpg', NULL, NULL, 3, 'Lebanese Hezbollah leader accuses Riyadh of declaring war', 'Hezbollah, Hassan Nasrallah, Lebanon, 11 November 2017 news, ', 'The leader of Lebanon\'s Hezbollah has accused Saudi Arabia of declaring war on his country, days after Lebanese PM Saad al-Hariri announced his resignation in the Saudi capital. Hassan Nasrallah said Saudi Arabia was holding Hariri against his will', 18, 8, NULL, 0, 0, 1, 0, '11 November 2017 11:50:51', 'J Nandy', '11 November 2017 09:52:49', '2017-11-27 10:45:41', '2017-11-11 15:52:49'),
(40, 18, 'Chocolate Industry making progress in Bangladesh', '', '', '<p><strong>Special Report:</strong> Chocolate is a highly demanded fancy food&nbsp;worldwide including Bangladesh. Though at present our country is legging far behind than the rest of the world in manufacturing this chocolate, but it is making progress slowly in this regard.</p>\r\n\r\n<p>Chocolate was introduced at first by Mayans and Aztecs in Central America at least 3 thousand years ago. But the manufacturing of chocolates started in Bangladesh 65 years ago only.</p>\r\n\r\n<p>Manufacturing of chocolates of the brand name Mimi was started in the country in 1965 by a machine exported from Germany. Production of Mimi chocolates was accomplished by Freedom Fighters Welfare Trust since 1972, after the country had become liberated in the previous year.</p>\r\n\r\n<p>But the golden age of Mimi chocolates was ended due to different reasons in course of time. At present, the chocolate factory is surviving somehow in a miserable condition.</p>\r\n\r\n<p>Some other companies also started chocolate production by taking technology from local and foreign sources. The number such entrepreneurs have increased in the mean time.</p>\r\n\r\n<p>At present, 4 large companies are manufacturing 15 to 17 types of chocolates, candies and lozenges in the country by bringing foreign technology. But the quality of their products is inferior to that of the foreign ones and it is a big challenge for the local manufacturers to face the strong competition with the imported chocolates.</p>\r\n\r\n<p>Besides, the big manufacturers of Bangladesh become compelled also to face a competition with small scale manufacturers, who produce chocolate in old-fashioned factories situated at different areas of the country.</p>\r\n\r\n<p>The annual market of country-made chocolates is of about taka one thousand crore. Import of chocolates in legal way has decreased as smuggling has increased during last five years. On the other hand, the quality control organisation BSTI has to remain busy frequently to tackle the adulteration in indigenous chocolate productions.</p>\r\n\r\n<p>Despite different limitations, the locally manufactured chocolates are being exported in about 11 countries of the world. But the entrepreneurs claim that the development of indigenous chocolate industry is being hard due to high tariff imposed on import of raw materials needed for making chocolate. They also think the lessening of tariff on imported chocolates as a threat to the local manufacturers.</p>\r\n', '', 'boishakhi_1510378735.jpg', 'boishakhi_1510378735.jpg', 'boishakhi_1510378735.jpg', 'boishakhi_1510378735.jpg', NULL, NULL, 3, 'Chocolate Industry making progress in Bangladesh', 'chocolate industry, Bangladesh, 11 November 2017 news, ', 'Chocolate is a highly demanded fancy food worldwide including Bangladesh. Though at present our country is legging far behind than the rest of the world in manufacturing this chocolate, but it is making progress slowly in this regard', 17, 11, NULL, 0, 0, 1, 0, '11 November 2017 11:38:55', 'J Nandy', '11 November 2017 11:38:55', '2017-11-27 10:45:41', '2017-11-11 17:38:55'),
(41, 18, 'Fest to be held to celebrate UNESCO recognition to Mujib\'s speech', '', '', '<p><strong>Staff Reporter:</strong> A festival of joy will be held all over the country on November 25 to celebrate UNESCO&rsquo;s recognition to Bangabandhu&rsquo;s speech of 7 March.</p>\r\n\r\n<p>The decision has been taken recently in a meeting held at the Prime Minister&rsquo;s office in the capital.</p>\r\n\r\n<p>According to the decision, different government offices and Awami League together with its factions will hold joy rallies across the country. Besides, cultural programmes and musical concerts will also be held on this occasion.</p>\r\n', '', 'boishakhi_1510380542.jpg', 'boishakhi_1510380542.jpg', 'boishakhi_1510380542.jpg', 'boishakhi_1510380542.jpg', NULL, NULL, 3, '', '7 March speech, Sheikh Mujibur Rahman, UNESCO,11 November 2017 news, ', 'A festival of joy will be held all over the country on November 25 to celebrate UNESCO’s recognition to Bangabandhu’s speech of 7 March. The decision has been taken recently in a meeting held at the Prime Minister’s office in the capital', 18, 104, NULL, 0, 0, 1, 0, '18 November 2017 10:53:59', 'J Nandy', '11 November 2017 12:09:02', '2017-11-27 10:45:41', '2017-11-11 18:09:02'),
(42, 18, 'Obaidul urges BNP not to create disorder centering November 12 rally', '', '', '<p><strong>Staff Reporter:</strong> Road Transpor and Bridges Minister as well as Awami League&rsquo;s General Secretary Obaidul Quader called upon BNP not to create any disorder centering the rally of November 12.</p>\r\n\r\n<p>He came up with the call while addressing a programme on the occasion of the birth anniversary of Guru Nanak, the founder of Sikh religion, at Gurdwara Nanakshahi situated in Dhaka University campus.</p>\r\n\r\n<p>The ruling party leader also said that the government allowed BNP to hold rally in Suhrawardy Udyan so that it can stage the rally peacefully.</p>\r\n\r\n<p>The minister further warned that if BNP tries to create disorder and chaos on this oppotunity, the law enforcers will supress it with iron hand. &nbsp;</p>\r\n\r\n<p>. &nbsp;</p>\r\n', '', 'boishakhi_1510384795.jpg', 'boishakhi_1510384795.jpg', 'boishakhi_1510384795.jpg', 'boishakhi_1510384795.jpg', NULL, NULL, 3, 'Obaidul urges BNP not to create disorder centering November 12 rally', 'Obaidul Quader, BNP, Gurdwara Nanakshahi, 11 November 2017 news, ', 'Road Transpor and Bridges Minister as well as Awami League’s General Secretary Obaidul Quader called upon BNP not to create any disorder centering the rally of November 12. He came up with the call while addressing a programme on the occasion', 14, 9, NULL, 0, 0, 1, 0, '11 November 2017 01:19:55', 'J Nandy', '11 November 2017 01:19:55', '2017-11-27 10:45:41', '2017-11-11 19:19:55'),
(43, 18, 'Nation celebrates recognition of Bangabandhu\'s speech today', 'Rally to be held in Suhrawardy Park', '', '<p><strong>Staff Reporter:</strong> The nation is celebrating today the recognition of the historic 7th March speech of Father of the Nation Bangabandhu Sheikh Mujibur Rahman as a world documentary heritage. All preparations have been taken to hold a&nbsp;grand rally&nbsp;at Shurwardy Udyan to celebrate the occasion&nbsp;.</p>\r\n\r\n<p>Nagorik Committee is organizing the rally where Prime Minister Sheikh Hasina will attend it as the chief guest.<br />\r\n<br />\r\nDhaka University Emeritus Professor Dr Anisuzzaman will preside over the rally at 2:30 pm.<br />\r\n<br />\r\nThe United Nations Educational, Scientific and Cultural Organisation (UNESCO) recognised the historic 7th March Speech of Bangabandhu as part of world&#39;s documentary heritage on October 31.<br />\r\n<br />\r\nUNESCO Director General Irina Bokova announced it saying the historic 7th March speech of Bangabandhu has been included in the Memory of the World International Register, a list of world&#39;s important documentary heritage maintained by the UNESCO.<br />\r\n<br />\r\nNagorik Committee has taken all preparations to make the rally a success.<br />\r\n<br />\r\nAwami League General Secretary and Road Transport and Bridges Minister Obaidul Quader yesterday visited Suhrawardy Udyan to see the preparations for the rally.<br />\r\n<br />\r\nDuring the visit, the AL general secretary told journalists that the rally organized by Nagorik Committee is not any &quot;counter political rally&quot;.<br />\r\n<br />\r\nHousing and Public Works Minister Engineer Mosharraf Hossain, AL Joint General Secretary Jahangir Kabir Nanak, State Minister for Textiles and Jute Mirza Azam, AL Organizing Secretary AKM Enamul Haque Shamim and Cultural Affairs Secretary Ashim Kumer Ukil, among others, accompanied Quader.<br />\r\n<br />\r\nThe ruling Awami League is set to showdown its political strength through rallies and various programmes in the coming weeks, party sources said.<br />\r\n<br />\r\nThey said they will gather a huge number of people at today&#39;s grand rally at Suhrawardy Udyan to highlight its popularity.<br />\r\n<br />\r\nEarlier on Wednesday, AL central committee organized a meeting at the party president&#39;s Dhanmondi office to make the grand rally a success.<br />\r\n<br />\r\nAL lawmakers from Dhaka and leaders of associate organisations attended the meeting.<br />\r\n<br />\r\nAL General Secretary Obaidul Quader, in the meeting, directed all leaders and lawmakers to gather a huge number of people in the rally.<br />\r\n<br />\r\nA meeting was also held at Prime Minister&#39;s Political Advisor HT Imam&#39;s house on November 13, while AL Dhaka City South unit held another meeting last week to make the rally a success.</p>\r\n', '', 'boishakhi_1510979728.jpg', 'boishakhi_1510979728.jpg', 'boishakhi_1510979728.jpg', 'boishakhi_1510979728.jpg', NULL, NULL, 3, 'Nation celebrates recognition of Bangabandhu\'s speech today', 'Bangabandhu, speech of March 7, UNESCO, celebration, 18 November 2017 news, ', 'The nation is celebrating today the recognition of the historic 7th March speech of Father of the Nation Bangabandhu Sheikh Mujibur Rahman as a world documentary heritage. All preparations have been taken to celebrate the programme at Shurwardy Udyan', 7, 1, NULL, 0, 0, 1, 0, '18 November 2017 12:05:23', 'J Nandy', '18 November 2017 10:35:28', '2017-11-27 10:47:48', '2017-11-18 16:35:28'),
(44, 18, 'US representative team arrives in Dhaka', 'Scheduled to visit Rohingya camp in Cox\'s Bazar', '', '<p><strong>Staff Reporter:</strong> A 10-member US representative team including two US senators and three Congressmen have reached in Dhaka to visit Rohingya camps in Cox&rsquo;s Bazar. They arrived at Shahajalal International Airport at 1:20am on Saturday.</p>\r\n\r\n<p>Kamrul Ahsan-- bilateral and consular secretary of Foreign Ministry, and Marcia Bloom Bernicat-- the US Ambassador to Bangladesh, have received them at the VIP lounge of the airport.</p>\r\n\r\n<p>They are scheduled to start for the Balukhali camp of Cox&rsquo;s Bazar around 10am on Saturday. After the visit, they will decide what to do in this regard<strong>.</strong></p>\r\n', '', 'boishakhi_1510980625.jpg', 'boishakhi_1510980625.jpg', 'boishakhi_1510980625.jpg', 'boishakhi_1510980625.jpg', NULL, NULL, 3, 'US representative team arrives in Dhaka', 'US representative team , Dhaka, Rohingya issue, 18 November 2017 news, ', 'A 10-member US representative team including two US senators and three Congressmen have reached in Dhaka to visit Rohingya camps in Cox’s Bazar. They arrived at Shahajalal International Airport at 1:20am on Saturday', 5, 2, NULL, 0, 0, 1, 0, '18 November 2017 10:50:25', 'J Nandy', '18 November 2017 10:50:25', '2017-11-27 10:45:41', '2017-11-18 16:50:25'),
(45, 18, '17,000 Rohingya children face severe health risk', 'Government and UNESCO take measures', '', '<p><strong>Cox&#39;s Bazar Corespondent:</strong> Among the Rohingyas sheltered in Bangladesh, 17 thousand children are on the face of severe health risk, while 1 lakh 76 thousand aged below 5 are suffering from various diseases in effect of malnutrition.</p>\r\n\r\n<p>Meanwhile, the government is launching &lsquo;Nutrition Action Week&rsquo; with the support of different international organisations including UNICEF. Concerned people and organisations are feeding vitamin &lsquo;A&rsquo; capsule to the Rohingya children aged between 6 to 59 months, while anti-worm tablets are being feed to the children aged between 12 months to 59 months.</p>\r\n\r\n<p>The programme began on November 15 and will last till 22 November. In this regard, State Minister for Health Zahid Malik said that the government is also working with utmost sincerity to provide treatment for mentally reatarded Rohingya children.&nbsp; &nbsp;</p>\r\n', '', 'boishakhi_1510982091.jpg', 'boishakhi_1510982091.jpg', 'boishakhi_1510982091.jpg', 'boishakhi_1510982091.jpg', NULL, NULL, 3, '17,000 Rohingya children face severe health risk', 'Rohingya children, health eisk, disease, UNESCO, 18 November 2017 news, ', 'Among the Rohingyas sheltered in Bangladesh, 17 thousand children are on the face of severe health risk, while 1 lakh 76 thousand aged below 5 are suffering from various diseases in effect of malnutrition', 6, 4, NULL, 0, 0, 1, 0, '18 November 2017 11:14:51', 'J Nandy', '18 November 2017 11:14:51', '2017-11-27 10:45:41', '2017-11-18 17:14:51');
