(46, 18, 'Zimbabwe\'s ruling Zanu-PF party wants Mugabe to resign', '', '', '<p><strong>International Desk:</strong> Regional branches of Zimbabwe&#39;s ruling Zanu-PF party have joined growing calls for President Robert Mugabe to resign.</p>\r\n\r\n<p>The move comes ahead of a protest march to be held in the capital Harare on Saturday, fully supported by the country&#39;s military which staged a takeover on Wednesday.</p>\r\n\r\n<p>War veterans until recently loyal to the 93-year-old president and liberal groups have also urged him to quit. Earlier Mugabe made his first public appearance since the takeover.</p>\r\n\r\n<p>Mugabe had been under house arrest for days, but attended a graduation ceremony on Friday, handing out degrees.</p>\r\n\r\n<p>The army made its move after a power struggle over his successor. The military said it was engaging with Mugabe and would advise the public on the outcome of talks as soon as possible.</p>\r\n', '', 'boishakhi_1510982772.jpg', 'boishakhi_1510982772.jpg', 'boishakhi_1510982772.jpg', 'boishakhi_1510982772.jpg', NULL, NULL, 3, 'Zimbabwe\'s ruling Zanu-PF party wants Mugabe to resign', 'President Robert Mugabe, Zimbabwe, Zanu-PF party, 18 November 2017 news, ', 'Regional branches of Zimbabwe\'s ruling Zanu-PF party have joined growing calls for President Robert Mugabe to resign. The move comes ahead of a protest march to be held in the capital Harare on Saturday', 4, 5, NULL, 0, 0, 1, 0, '18 November 2017 11:26:12', 'J Nandy', '18 November 2017 11:26:12', '2017-11-27 10:45:41', '2017-11-18 17:26:12'),
(47, 18, 'Lebanese Premier Hariri leaves Riyadh for Paris', '', '', '<p><strong>International Desk:</strong>&nbsp;Lebanese Prime Minister Saad Hariri has left Saudi Arabia for France, a TV channel owned by his family said.</p>\r\n\r\n<p>Hariri earlier denied claims he was being held hostage in the Gulf kingdom, tweeting that it is a lie. Hariri resigned unexpectedly during a visit to Riyadh on 4 November - but his resignation has not been accepted.</p>\r\n\r\n<p>Hariri left Riyadh airport on his private jet with his wife and is headed for Le Bourget airport, near Paris, Future TV announced early on Saturday.</p>\r\n\r\n<p>He&nbsp;is expected to meet French President Emmanuel Macron and then visit other Arab capitals before a possible return to the Lebanese capital Beirut.</p>\r\n\r\n<p>On Wednesday, President Macron said he had invited Hariri and his family to Paris after the French leader spoke by telephone to Saudi Crown Prince Mohammed bin Salman.</p>\r\n', '', 'boishakhi_1510983576.jpg', 'boishakhi_1510983576.jpg', 'boishakhi_1510983576.jpg', 'boishakhi_1510983576.jpg', NULL, NULL, 3, 'Lebanese Premier Hariri leaves Riyadh for Paris', 'Lebanese Prime Minister, Saad Hariri, riyadh, Paris, 18 November 2017 news, ', 'Lebanese Prime Minister Saad Hariri has left Saudi Arabia for France, a TV channel owned by his family said. Hariri earlier denied claims he was being held hostage in the Gulf kingdom, tweeting that it is a lie', 3, 6, NULL, 0, 0, 1, 0, '18 November 2017 11:39:36', 'J Nandy', '18 November 2017 11:39:36', '2017-11-27 10:45:41', '2017-11-18 17:39:36'),
(48, 18, '4 Foreign Ministers to visit Rohingya camp on Sunday', '', '', '<p><strong>Staff Reporter:</strong> Foreign Ministers of four countries including&nbsp;Japan and Germany are&nbsp;set to visit Bangladesh to have a glance on the ongoing Rohingya humanitarian catastrophe.</p>\r\n\r\n<p>Chinese Foreign Minister Wang Yi has already reached in Dhaka, &nbsp;and the High Representative of European Union Federica Mogherini will arrive in Bangladesh tomorrow.</p>\r\n\r\n<p>They will visit Rohingya refugee camps of Cox&rsquo;s Bazar on Sunday. Foreign Minister A. H. Mahmud Ali will accompany them during the visit.</p>\r\n\r\n<p>The foreign representatives will also observe humanitarian activities of different local and international aid organisations during their visit.&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n', '', 'boishakhi_1510984659.jpg', 'boishakhi_1510984659.jpg', 'boishakhi_1510984659.jpg', 'boishakhi_1510984659.jpg', NULL, NULL, 3, '4 Foreign Ministers to visit Rohingya camp on Sunday', 'Foreign Ministers, Japan, China, Rohingya camp, 18 November 2017 news, ', 'Foreign Ministers of four countries including Japan and Germany are set to visit Bangladesh to have a glance on the ongoing Rohingya humanitarian catastrophe. Chinese Foreign Minister Wang Yi has already reached in Dhaka', 5, 3, NULL, 0, 0, 1, 0, '18 November 2017 11:58:51', 'J Nandy', '18 November 2017 11:57:39', '2017-11-27 10:45:41', '2017-11-18 17:57:39');
